(1, 'UCWJ2lWNubArHWmf3FIHbfcQ', '@nba', 'NBA', 'The NBA is the premier professional basketball league in the United States and Canada. The league is truly global, with games and programming in 215 countries and territories in 47 languages. The NBA consists of 30 teams. The NBA offers real time access to live regular season NBA games with a subscription to NBA LEAGUE PASS, available globally for TV, broadband, and mobile.  Real-time Stats, Scores, Highlights and more are available to fans on web and mobile with the NBA App. \n\nFor news, stories, highlights and more, go to our official website at https://app.link.nba.com/e/NBA_site\n', '2005-11-21 01:20:33', 'US', '{\"relatedPlaylists\": {\"likes\": \"\", \"uploads\": \"UUWJ2lWNubArHWmf3FIHbfcQ\"}}', '{\"high\": {\"url\": \"https://yt3.ggpht.com/urNLBJGryDamao5r0jmlTg84mIBOoaeJd6XR67j4nuRd0iRvv5g-MUgaowsWKCs8V_t4KwST=s800-c-k-c0x00ffffff-no-rj\", \"width\": 800, \"height\": 800}, \"medium\": {\"url\": \"https://yt3.ggpht.com/urNLBJGryDamao5r0jmlTg84mIBOoaeJd6XR67j4nuRd0iRvv5g-MUgaowsWKCs8V_t4KwST=s240-c-k-c0x00ffffff-no-rj\", \"width\": 240, \"height\": 240}, \"default\": {\"url\": \"https://yt3.ggpht.com/urNLBJGryDamao5r0jmlTg84mIBOoaeJd6XR67j4nuRd0iRvv5g-MUgaowsWKCs8V_t4KwST=s88-c-k-c0x00ffffff-no-rj\", \"width\": 88, \"height\": 88}}', '{\"viewCount\": \"12596961286\", \"videoCount\": \"47677\", \"subscriberCount\": \"20700000\", \"hiddenSubscriberCount\": false}'),
(2, 'UCyEd6QBSgat5kkC6svyjudA', '@markwiens', 'Mark Wiens', 'Food is the reason you should travel, and on my channel you\'ll watch videos about delicious street food and travel tips!\n\nHey, I\'m Mark Wiens!\n\nAfter graduating from university, I decided to travel for food. Eventually I ended up in Thailand, where I met my wife. My wife and I are now based in Bangkok, Thailand, but we travel frequently to find delicious food.\n\nYou\'ll find street food videos, travel vlogs, and plenty of Thai food videos as that\'s where I\'m based.\n\nI hope you\'re ready for a delicious food adventure!\n\nVideo Posting Schedule:\nSundays & Wednesdays at 8 pm Bangkok time (GMT+7), and some occasional extras. Subscribe now so you don\'t miss the next video!', '2009-02-02 18:47:12', 'US', '{\"relatedPlaylists\": {\"likes\": \"\", \"uploads\": \"UUyEd6QBSgat5kkC6svyjudA\"}}', '{\"high\": {\"url\": \"https://yt3.ggpht.com/ytc/AGIKgqO7ds3zPJME4RraNV6JkikvzXnWHKkWXjeAJmy9pug=s800-c-k-c0x00ffffff-no-rj\", \"width\": 800, \"height\": 800}, \"medium\": {\"url\": \"https://yt3.ggpht.com/ytc/AGIKgqO7ds3zPJME4RraNV6JkikvzXnWHKkWXjeAJmy9pug=s240-c-k-c0x00ffffff-no-rj\", \"width\": 240, \"height\": 240}, \"default\": {\"url\": \"https://yt3.ggpht.com/ytc/AGIKgqO7ds3zPJME4RraNV6JkikvzXnWHKkWXjeAJmy9pug=s88-c-k-c0x00ffffff-no-rj\", \"width\": 88, \"height\": 88}}', '{\"viewCount\": \"2432106690\", \"videoCount\": \"1327\", \"subscriberCount\": \"9940000\", \"hiddenSubscriberCount\": false}');
