INSERT INTO `youtube_channel_videos` (`id`, `kind`, `videoId`, `channelId`, `channelTitle`, `title`, `description`, `thumbnails`, `videoPublishedAt`) VALUES
(51, 'youtube#playlistItem', 'OpP_WNGgY1k', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'Extreme Backyard Barbecue!! 🇺🇸 You’ll ONLY Get This in South Carolina!', '🦐 Gullah Geechee Food in the Lowcountry: https://youtu.be/MeEnvHe0pmE\n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ \n\nCHARLESTON, SOUTH CAROLINA - We’re just outside Charleston, South Carolina, and on Sunday, I was invited over to my friend John Haney’s (https://www.instagram.com/alveronbbqco8462) house for a real deal southern barbecue. It was an incredible experience, watching John and bbq and all of his side dishes including collard greens and the greatest bbq mac n cheese you’ll ever have.\n\nAdditionally, in South Carolina is the only place you\'ll find hash, a mixture of all the pig bits including the face made into a stew. There\'s ketchup based hash and mustard based hash, and we had a full lesson on South Carolina hash.\n\nJohn Haney (Alveron BBQ) makes the best bbq grills in the United States all hand made - so definitely hit him up: https://www.instagram.com/alveronbbqco8462 and he also one of the greatest legends of American bbq.\n\nHuge thank you to John and his family for hosting my family and I on this amazing Sunday meal.\n\nSocial Media:\nFacebook: https://www.facebook.com/markwiensfoodvideos \nInstagram: https://www.instagram.com/migrationology/ \nTiktok: https://www.tiktok.com/@markwiens \n\n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ\n🎥 Camera gear I use: https://amzn.to/3FVdBUd \n(some of these are Amazon affiliate links)', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/OpP_WNGgY1k/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/OpP_WNGgY1k/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/OpP_WNGgY1k/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/OpP_WNGgY1k/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/OpP_WNGgY1k/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-07-04 13:00:19'),
(52, 'youtube#playlistItem', 'MeEnvHe0pmE', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'Real Lowcountry Food!! 🦐 SHRIMP & GRITS - Gullah Geechee Food in Southern USA!', '🥩 American BBQ with Rodney Scott: https://youtu.be/nzJOHYYclPc\n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ \n\nST. HELENA ISLAND, SOUTH CAROLINA - Today we’re visiting St. Helena in South Carolina, an island that’s preserved much of its Gullah Geechee and Lowcountry heritage, culture and food.\n\nWe have the honor of meeting up with Tony and Belinda Jones from Morning Glory Homestead - https://www.morninggloryhomestead.com/ to learn about Gullah Geechee history and cook a full farm to table southern USA, lowcountry meal. On the menu is one of the greatest dishes of all time, shrimp and okra, with local grits, rice, and fried whiting fish.\n\nWe picked our own okra from the farm, and cooked everything fresh Gullah Geechee style under the sweeping live oak trees.\n\nThank you again to Tony and Belinda Jones from Morning Glory Homestead - https://www.morninggloryhomestead.com/ for hosting me for this incredible Gullah Geechee food and cultural experience in South Carolina.\n\nSocial Media:\nFacebook: https://www.facebook.com/markwiensfoodvideos \nInstagram: https://www.instagram.com/migrationology/ \nTiktok: https://www.tiktok.com/@markwiens \n\n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ\n🎥 Camera gear I use: https://amzn.to/3FVdBUd \n(some of these are Amazon affiliate links)', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/MeEnvHe0pmE/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/MeEnvHe0pmE/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/MeEnvHe0pmE/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/MeEnvHe0pmE/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/MeEnvHe0pmE/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-07-01 13:00:24'),
(53, 'youtube#playlistItem', 'AhRgJ2VIihM', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'Famous GARLIC BUTTER Blue Crabs!! 🦀 Must-Eat SOUL FOOD in Charleston, South Carolina!', '🥩 American BBQ with Rodney Scott: https://youtu.be/nzJOHYYclPc\n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ \n\nCHARLESTON, SOUTH CAROLINA - Today we’re going on a Gullah Geechee and Soul Food tour in Charleston, South Carolina. I’ll be trying some of the classic dishes like Turkey wings, red rice, crab and rice, and not missing out on the mountain of garlic butter crabs!\n\nBertha\'s Kitchen (https://goo.gl/maps/T8wwFps9wdtCXo5W6) \nThis was one of the restaurants I was most looking forward to trying when I was in Charleston - so try their traditional Soul food and Gullah food. They’ve even won a James Beard award! Their red rice, fried catfish, and especially their giant turkey wing was the highlight. Excellent food, highly recommended when you’re in Charleston.\n\nHannibal\'s Kitchen (https://goo.gl/maps/WbwRxT1CvovrtaSX9) \nNext we headed to Hannibal\'s Kitchen, again a restaurant that legendary for their Gullah food in Charleston. They have all sorts of southern specialties here including crab rice and lima beans with pig tails.\n\nRavenel Fresh Seafood (https://goo.gl/maps/xBvyKxvtCsuuNN196) \nBig thank you to Chef BJ Dennis (https://www.instagram.com/chefbjdennis/) for this recommendation. Ravenel Fresh Seafood serves local South Carolina seafood, prepared Gullah style. You can’t go wrong with the red rice and fried fish, but people most come here for the mountain of crabs with thick garlic butter sauce all over it.\n\nSocial Media:\nFacebook: https://www.facebook.com/markwiensfoodvideos \nInstagram: https://www.instagram.com/migrationology/ \nTiktok: https://www.tiktok.com/@markwiens \n\n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ\n🎥 Camera gear I use: https://amzn.to/3FVdBUd \n(some of these are Amazon affiliate links)', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/AhRgJ2VIihM/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/AhRgJ2VIihM/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/AhRgJ2VIihM/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/AhRgJ2VIihM/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/AhRgJ2VIihM/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-06-27 13:00:11'),
(54, 'youtube#playlistItem', '6PYPYaNPxEA', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'America\'s Best Oysters!! 🦪 SEAFOOD TOUR in Charleston, South Carolina!', '🥩 American BBQ with Rodney Scott: https://youtu.be/nzJOHYYclPc\n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ \n\nCHARLESTON, SOUTH CAROLINA - Welcome to Charleston, one of the food capitals of the United States, and home to some of America’s best oysters. Today we’re going on a seafood tour of Charleston, especially focusing on the incredible oysters.\n\nBarrier Island Oyster Co. (https://www.barrierislandoysters.com/) \nWe’re starting this seafood tour at the Barrier Island Oyster Co., who are responsible for growing and serving some of the best oysters in South Carolina - in the United States. One of their signature oysters are the sea clouds, which have an extraordinary balance of flavor. It was amazing to see the process and behind the scenes of how oysters are grown before they reach your table.\n\nThe Ordinary (https://goo.gl/maps/gVGzwuLxu9EThtjS6) \nNext up we headed to The Ordinary, a well known seafood restaurant, serving a mix of seafood and especially fresh oysters and an outstanding raw bar. Food was delicious.\nTotal price - $163 for everything\n\nChubby Fish (https://goo.gl/maps/BdEn8A8YHf8fEQme9)\nOne of the restaurants I was most looking forward to trying in Charleston was Chubby Fish with Chef James London. He’s a legendary chef in South Carolina using the freshest seafood ingredients in creative and vibrant combinations. We had the oysters, and some more sea clouds, and an array of outstanding other local seafood dishes. Chubby Fish was without a doubt one of the best meals I ate in Charleston.\n\nSocial Media:\nFacebook: https://www.facebook.com/markwiensfoodvideos \nInstagram: https://www.instagram.com/migrationology/ \nTiktok: https://www.tiktok.com/@markwiens \n\n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ\n🎥 Camera gear I use: https://amzn.to/3FVdBUd \n(some of these are Amazon affiliate links)', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/6PYPYaNPxEA/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/6PYPYaNPxEA/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/6PYPYaNPxEA/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/6PYPYaNPxEA/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/6PYPYaNPxEA/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-06-24 13:00:09'),
(55, 'youtube#playlistItem', 'nzJOHYYclPc', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'King of AMERICAN BARBECUE!! 🔥 #1 Pitmaster Rodney Scott Shares His Secrets to Perfect BBQ!', '🥩 American BBQ with JL: https://youtu.be/F29_OcpR1ls\n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ \n\nSOUTH CAROLINA, USA - Today we’re going to two of the most legendary barbecue smoke houses in the United States. They do everything the traditional way - using only hard woods. We’ll begin with the original Scott’s Bar-B-Que in Hemingway, South Carolina and continue to Rodney Scott\'s BBQ in Charleston.\n\nScott’s Bar-B-Que: https://goo.gl/maps/uEcd1Q44iV2L2iHK9 \nTo begin, we started where it all began, in the small town of Hemingway, South Carolina. The bbq was excellent and I especially enjoyed the ribs and the chicken.\n\nRodney Scott\'s BBQ: https://goo.gl/maps/b4VG6u6qypfHsyxg8 \nIt was an honor to spend a few hours with one of America’s best pitmasters Rodney Scott. I asked him what makes good bbq, and he immediately answered patience, hard wood, good proteins, music and storytelling. Rodney also sprinkles on seasoning, spoons out the meat, and uses a mop to add sauce!\n\nSocial Media:\nFacebook: https://www.facebook.com/markwiensfoodvideos \nInstagram: https://www.instagram.com/migrationology/ \nTiktok: https://www.tiktok.com/@markwiens \n\n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ\n🎥 Camera gear I use: https://amzn.to/3FVdBUd \n(some of these are Amazon affiliate links)', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/nzJOHYYclPc/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/nzJOHYYclPc/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/nzJOHYYclPc/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/nzJOHYYclPc/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/nzJOHYYclPc/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-06-20 13:00:29'),
(56, 'youtube#playlistItem', 'tenjXXrJQEQ', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'Freshest Sashimi + Australian Backyard Barbecue!! 🍣 Tuna Fishing in Australia!', '🇦🇺 Ultimate Australian Food Tour: https://youtu.be/I3Bsemi7zIw \n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ \n\nSORRENTO, AUSTRALIA - South of Melbourne where the bay opens into the sea is one of the great fishing spots in Australia, especially for local Bluefin Tuna. Today we’re going fishing, then coming back to the house to have a beach house, backyard barbecue!\n\nHuge thank you to Richard, Chef Nick and Tess from HER Melbourne (https://her.melbourne/) for taking us on this incredible fishing trip and backyard BBQ.\nChef Nick: https://www.instagram.com/nick_bennett_sourdough/\nTess: https://www.instagram.com/_tessstewart/\n\nFrom Melbourne we caught a helicopter down to Sorrento, and from there we boarded the boat and sailed into the open sea. We were lucky with perfect conditions and while the water in these parts can often be rough, today it was calm. We were lucky to be with very experienced fishers and after some searching, we finally landed a small tuna. What a thrilling experience!\n\nWe headed back to Sorrento for a barbecue, and taste of some of the freshest tuna sashimi I’ve ever had. Ironically, tuna is best when it ages a few days, so we didn’t eat the whole fish, but we did try it!\n\nSocial Media:\nFacebook: https://www.facebook.com/markwiensfoodvideos \nInstagram: https://www.instagram.com/migrationology/ \nTiktok: https://www.tiktok.com/@markwiens \n\n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ\n🎥 Camera gear I use: https://amzn.to/3FVdBUd \n(some of these are Amazon affiliate links)', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/tenjXXrJQEQ/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/tenjXXrJQEQ/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/tenjXXrJQEQ/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/tenjXXrJQEQ/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/tenjXXrJQEQ/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-06-17 11:00:45'),
(57, 'youtube#playlistItem', 'VZIc5jXss-g', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'BIGGEST Crab I’ve Ever Seen!! 🦀 TASMANIAN KING CRAB - Cooked 3 Ways!!', '🇦🇺 Ultimate Australian Food Tour: https://youtu.be/I3Bsemi7zIw \n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ \n\nSYDNEY, AUSTRALIA - We’re going to the fish market to get a Huge Tasmanian King Crab and Chef Dan Hong is going to cook it 3 ways!\n\nHuge thank you to:\nChef Dan Hong: https://www.instagram.com/hongsta_gram/\n\nSydney Fish Market (https://goo.gl/maps/khNKtN7KUUGPv2xs5) - After meeting up with Chef Dan, we met up with Alex from the Sydney Fish market who showed us around and gave us a very interesting brief about the Sydney Fish market and the quality of seafood that auctioned.\n\nRed Claw Seafoods (https://redclawseafoods.com.au/) - At the fish market we visited Red Claw Seafood who specialize in some of the best live seafood in all of Australia and where Chef Dan gets his supply. We were after their insanely huge Tasmanian king crab!\n\nMr. Wong (https://goo.gl/maps/mcoC3PUG2GCL9Vq48) - After getting our crab, we headed back to Chef Dan’s restaurant, Mr. Wong, for some dim sum, roast duck, and mostly importantly, the fresh giant Tasmanian King Crab! It was without a double one of the best crabs, both in natural product and preparation that I’ve ever had. It was so big, Chef Dan had to cook three different dishes with it.\n\nSocial Media:\nFacebook: https://www.facebook.com/markwiensfoodvideos \nInstagram: https://www.instagram.com/migrationology/ \nTiktok: https://www.tiktok.com/@markwiens \n\n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ\n🎥 Camera gear I use: https://amzn.to/3FVdBUd \n(some of these are Amazon affiliate links)', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/VZIc5jXss-g/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/VZIc5jXss-g/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/VZIc5jXss-g/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/VZIc5jXss-g/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/VZIc5jXss-g/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-06-13 11:00:25'),
(58, 'youtube#playlistItem', 'JCfI9Xlj7Io', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'Australian Fast Food!! 🇦🇺 TOP 5 CHEAP EATS in Sydney, Australia!', '🇦🇺 Ultimate Australian Food Tour: https://youtu.be/3xAG5f5waDw\n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ \n\nSYDNEY, AUSTRALIA - Welcome to Sydney, Australia! Today we’re going on a cheap eats tour of Sydney to eat 5 of the most iconic and affordable meals that you have to try. From charcoal chicken to Halal snack pack, it’s going to be a delicious day of food in Australia!\n\n1. Marrickville Pork Roll - https://goo.gl/maps/Fu6oDvRozM6nLGgX6 Price - $8 AUD (5.37 USD) per roll - Sydney has a large Vietnamese population and banh mi are extremely popular and affordable.\n\n2. Metro One Kebab Ashfield - https://goo.gl/maps/dBs51Jbw4TaQCqyg9 Price - $20 AUD (13.42 USD) for Large - One of the most famous Sydney foods is a Halal snack pack, HSP for short - and it’s one of the greatest Australian cheap eats.\n\n3. El Jannah Granville - https://goo.gl/maps/wVL84F87ME3eAe4r6 Price - $15.90 AUD (10.67 USD) for ½ chicken plate - El Jannah Granville serves Lebanese charcoal roasted chicken.\n\n4. Chinese Noodle Restaurant - https://goo.gl/maps/FuR3yokWEuLsFnzu9 Price - $15.80 AUD (10.58 USD) - This noodle restaurant is known for their northern Chinese fried noodles and dumplings.\n\n5. Indian Home Diner - https://goo.gl/maps/gudGiYZp3G5RiaC26 Price - $15 AUD (10.06 USD) for Double Chicken Tikka Kebab, which was tasty and convenient.\n\nOf course this only scratches the surface of the diversity and the quantity of what you can eat in Sydney - there’s so much delicious food to discover!\n\nSocial Media:\nFacebook: https://www.facebook.com/markwiensfoodvideos \nInstagram: https://www.instagram.com/migrationology/ \nTiktok: https://www.tiktok.com/@markwiens \n\n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ\n🎥 Camera gear I use: https://amzn.to/3FVdBUd \n(some of these are Amazon affiliate links)', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/JCfI9Xlj7Io/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/JCfI9Xlj7Io/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/JCfI9Xlj7Io/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/JCfI9Xlj7Io/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/JCfI9Xlj7Io/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-06-10 11:00:25'),
(59, 'youtube#playlistItem', '7_rJKwF5EvQ', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'FISH & CHIPS Mountain!! 🐟 🍟 Best Australian SEAFOOD on the Great Ocean Road!!', '🇦🇺 Ultimate Australian Food Tour: https://youtu.be/I3Bsemi7zIw \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ \n👕 T-shirts: https://store.migrationology.com/ \n\nGREAT OCEAN ROAD, AUSTRALIA - Today we’re going on a tour of the iconic Great Ocean Road, and we’ll be eating some of the best Australian seafood along the way.\n\nThe Great Ocean Road is a historical highway that connects remote coastal towns along the southern coast of Australia. It was initially started as a project to create jobs for soldiers returning from WW1. The construction began in 1919 and was mostly completed when it was handed over to the government in 1936. When I visited Australia, I was excited to drive this iconic road for the majestic natural beauty - the rugged sea cliffs, the windswept coast  - and probably most of all - to discover some of the best local seafood restaurants along the way.\n\nFriends in the video:\nChef Gigg: https://www.instagram.com/chef_gigg_kamol/ \nPongtap: https://www.instagram.com/pongtap_lunlaman/ \n\nHere are all the places we visited on this ultimate Australian food tour:\n\n1. Fishos Torquay - https://goo.gl/maps/c3mdgx3ssNnGmoj26 Total Price - 111 AUD (74.45 USD) - We started off in the surf town of Torquay to eat our first meal at Fishos Torquay!\n\n2. Fish by Moonlight - https://goo.gl/maps/VsLB6u5WL5hnXetm9 Total price - 104.54 AUD (70.11 USD) - This small strip-mall restaurant proved to be one of the best meals I had in Australia - one of the best ever fish and chips!\n\n3. Cafe Koala - https://goo.gl/maps/Na9zD6JZpD23f68s9 Total price - 26.54 AUD (17.80 USD)\n\n4. Apollo Bay Fishermen\'s Co-Op - https://goo.gl/maps/99hLmAJAxVsBBRmb7 Total price - 317.83 AUD (213.20 USD) - One of the famous seafood restaurants along the Great Ocean Road and must stop when you’re in Apollo Bay for seafood and especially rock lobsters.\n\n5. Twelve Apostles - https://goo.gl/maps/vy5pCKS2orYPiUUR8 \nOne of our main sightseeing destinations was the magnificent Twelve Apostles.\n\n6. Craypot Bistro - https://goo.gl/maps/U3gwLhFBuDBWXupY8 Total price - 152.76 AUD (102.46 USD) - We arrived in Port Campbell and had a quick Australian pub dinner.\n\n7. Loch Ard Gorge https://goo.gl/maps/nh4tq3Umih5R5uWs8 \nFinally the next morning we quickly stopped off at Loch Ard Gorge to complete our food tour on Australia’s Great Ocean Road.\n\nSocial Media:\nFacebook: https://www.facebook.com/markwiensfoodvideos \nInstagram: https://www.instagram.com/migrationology/ \nTiktok: https://www.tiktok.com/@markwiens \n\n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ\n🎥 Camera gear I use: https://amzn.to/3FVdBUd \n(some of these are Amazon affiliate links)', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/7_rJKwF5EvQ/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/7_rJKwF5EvQ/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/7_rJKwF5EvQ/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/7_rJKwF5EvQ/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/7_rJKwF5EvQ/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-06-06 11:00:05'),
(60, 'youtube#playlistItem', '3xAG5f5waDw', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'Ultimate Australian Food Tour!! 🇦🇺 TOASTY HEAVEN + Best Kebabs in Melbourne!!', '🇦🇺 Ultimate Australian Food Tour: https://youtu.be/I3Bsemi7zIw \n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ \n\nMELBOURNE, AUSTRALIA - Today we’re going on an ultimate food tour in Melbourne to eat some of the tastiest and most iconic foods and to show the diversity of cultures and foods that are represented. It’s going to be a delicious food day and you’re not going to want to miss any of it!\n\nThank you to all my friends in the video:\nSofia Levin (https://www.instagram.com/sofiaklevin/)\nChef Nick: https://www.instagram.com/nick_bennett_sourdough/\nTess: https://www.instagram.com/_tessstewart/\n\nHere are all the restaurants we visited on this Melbourne food tour:\n\n1. Hector\'s Deli (https://goo.gl/maps/8tacVthQndc8eSwu6) - Toasty sandwiches are extremely popular in Melbourne and Hector’s Deli serves some of the best!\n\n2. Pipi\'s Kiosk (https://goo.gl/maps/B57r5KatBfnkwjrz9) - Located right along the beach Pipi\'s Kiosk is known for their boat to table, Chef driven seafood.\n\n3. Ca Com Bánh Mì Bar (https://goo.gl/maps/SzsYcX1fe4gjs1cE6) - At this small Vietnamese banh mi bar they make everything fresh in house and everything is cooked over fire. \n\n4. Arbory Afloat (https://goo.gl/maps/LB9KRMKDzr57d7o88_ - In mid Afternoon we visited one of the most popular bars and the biggest floating restaurant in Melbourne. Drink and pizza are some of the best in the city with a lively atmosphere.\n\n5. Pidapipó Carlton (https://goo.gl/maps/MPGiYihVeMGima5B7) - In the evening we stopped to have some of the best gelato in Melbourne.\n\n6. Supernormal (https://goo.gl/maps/p16xRDoTTsUawMrX6) - Chef Andrew McConnell is one of the most well known chefs from Melbourne and we had a great meal at Supernormal, a Asian inspired restaurant.\n\n7. Komur (https://goo.gl/maps/6TRdE3Mw3bmSFDVT8) - Finally, I can say Komur was one of the best meals and best restaurants I ate at in Melbourne. Emir Uker comes from a lineage of kebab makers and his Turkish food will impress you, outstanding!\n\nSocial Media:\nFacebook: https://www.facebook.com/markwiensfoodvideos \nInstagram: https://www.instagram.com/migrationology/ \nTiktok: https://www.tiktok.com/@markwiens \n\n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ\n🎥 Camera gear I use: https://amzn.to/3FVdBUd \n(some of these are Amazon affiliate links)', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/3xAG5f5waDw/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/3xAG5f5waDw/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/3xAG5f5waDw/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/3xAG5f5waDw/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/3xAG5f5waDw/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-06-03 11:00:04'),
(61, 'youtube#playlistItem', 'z6--8iUZnp0', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'Head-Sized OYSTERS!! Aussie BBQ Surf & Turf w/ The Grill Sisters!!', '🇦🇺 Ultimate Australian Food Tour: https://youtu.be/I3Bsemi7zIw \n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ \n\nA huge thank you to the Grill Sisters (https://www.instagram.com/grill.sisters/) for inviting us over for an ultimate backyard Aussie BBQ!\nDesi: https://www.instagram.com/healthycook4champions/ \nIrene: https://www.instagram.com/come.grill.with.me/ \nAnd check out their cookbook!\n\nMELBOURNE, AUSTRALIA - Welcome to the beautiful city of Melbourne! I was extremely excited to hang out with Desi and Irene, The Grill Sisters, who are extremely passionate about barbecue. Today they are cooking up some of their favorite recipes, including grilled octopus, lamb backstrap, and gigantic head sized wild Tasmanian oysters!\n\nIt’s going to be an ultimate backyard Australian food barbecue!\n\nThank you again to The Grill Sisters!\n\nAlthough there’s so much more to learn, this was an introduction to learning what Australian food is!\n\nSocial Media:\nFacebook: https://www.facebook.com/markwiensfoodvideos \nInstagram: https://www.instagram.com/migrationology/ \nTiktok: https://www.tiktok.com/@markwiens \n\n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ\n🎥 Camera gear I use: https://amzn.to/3FVdBUd \n(some of these are Amazon affiliate links)', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/z6--8iUZnp0/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/z6--8iUZnp0/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/z6--8iUZnp0/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/z6--8iUZnp0/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/z6--8iUZnp0/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-05-30 11:00:48'),
(62, 'youtube#playlistItem', 'I3Bsemi7zIw', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'First time in AUSTRALIA!! 🇦🇺 Kangaroo + Huge BOGAN BURGER!! | What is Australian Food??', '🇦🇺 Ultimate Australian Food Tour in Melbourne!\n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ \n\nMELBOURNE, AUSTRALIA - Welcome to Melbourne, Victoria, Australia! Today we’re going to answer the question - what is Australian Food? This is my first trip to Australia, so I’m excited to explore and to eat my way through Melbourne.\n\nThank you to all my friends in the video:\nHuge thank you to Chef Nick and Tess from HER Melbourne (https://her.melbourne/) for hosting me in Melbourne and for taking me around.\nChef Nick: https://www.instagram.com/nick_bennett_sourdough/\nTess: https://www.instagram.com/_tessstewart/\n\nAlso a huge thank you to Sofia Levin (https://www.instagram.com/sofiaklevin/) for showing us some of the best food in Melbourne!\n\nHere’s the full Australian food tour: \n\n1: South Melbourne Market - https://goo.gl/maps/6Vefo5Ez1gNeDP5E6\nWe’re starting out at South Melbourne Market to try some of the local foods available. Starting with jam donuts, meat pies, seafood, a quick oyster shot, and finally the legendary dim sim!\n\n2. Industry Beans - https://goo.gl/maps/ZEnA2so2xScVQ4CM9 \nNext up on this Australian food tour we’re having coffee - and in Melbourne they take coffee culture seriously.\n\n3. Terror Twilight - https://goo.gl/maps/CcBrVwo1qrdZGECM6 \nJust like coffee culture, Australian brunch culture is very strong, and they have influenced the world with brunch, and of course - avocado toast.\n\n4: Big Esso (Mabu Mabu) - https://goo.gl/maps/5WrjENeqZS8VojrU7 \nI wouldn’t want to make a video about what Australian food is without original indigenous Australian food. Big Esso is one of the few true Australian restaurants where Chef Nornie Bero from the Torres Straits serves modern Australian dishes using only local ingredients. Emu, saltbush, and green ants!\n\n5: The Napier Hotel: https://goo.gl/maps/8VguVAZWeVJFMBoM7 \nAnother part of Australian food culture is the Australian pub. Along with a classic Aussie meat pie, chicken parma (or kangaroo parma), don’t miss the giant Bogan Burger.\n\n6: Gerald\'s Bar - https://goo.gl/maps/eJGXgUfKB3fvqXxo7 \nNext up on this food tour we’re going to a local neighborhood wine bar, a favorite in Melbourne.\n\n7: Supper Inn - https://goo.gl/maps/rKnZMu8uNzRCrX9y5 \nLastly, one of the biggest parts of Australia is the diversity and people from around the world who have migrated to Australia, including many Chinese. Melbourne is home to a substantial Chinatown and we’re eating at one of the absolutely classics.\n\nAlthough there’s so much more to learn, this was an introduction to learning what Australian food is!\n\nSocial Media:\nFacebook: https://www.facebook.com/markwiensfoodvideos \nInstagram: https://www.instagram.com/migrationology/ \nTiktok: https://www.tiktok.com/@markwiens \n\n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ\n🎥 Camera gear I use: https://amzn.to/3FVdBUd \n(some of these are Amazon affiliate links)', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/I3Bsemi7zIw/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/I3Bsemi7zIw/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/I3Bsemi7zIw/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/I3Bsemi7zIw/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/I3Bsemi7zIw/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-05-27 11:00:19'),
(63, 'youtube#playlistItem', 'FwetMQ3G0xs', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'Food Tour in Okinawa!! DELICIOUS + BIZARRE FOODS Only on This Island!!', '🇯🇵 Japanese Street Food Tour: https://youtu.be/0II-qU0ADr4\n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ \n\nNAHA, OKINAWA - Okinawa is an island in southern Japan, yet its culture and food are vastly different from what you typically think of as Japanese. Today I’m hanging out with my friend Yuji-San and we’re going to take you on an ultimate Okinawan food tour!\n\nThanks to my friend Yuji-San for taking me about Naha: https://www.instagram.com/hotel_manager_jt/ \n\n1. MEGURO miso soup stand: https://goo.gl/maps/rGGLu9RtcAL23eHo9 - We started off for the greatest ever rice ball and craft miso soup. It was a totally new experience and appreciation for miso soup.\nTotal price - 2,800 JPY\n\n2. Tofu Soba at Takaesu Soba: https://goo.gl/maps/mD4vzTqqHxaJdCSL8 - In Okinawa, soba is totally different from the buckwheat noodles you get in other parts of Japan. Okinawan soba is something nearly everyone eats for lunch and it’s more similar to ramen with wheat noodles and pork ribs. We went to this special place for their tofu soba.\nTotal price - 2,770 JPY\n\n3. Ice snow cones at Fujiya Tomari: https://goo.gl/maps/Q8SF83Vjq6FoUUwH9 - Another thing you have to try in Okinawa is their snow cones.\nPrice - 1,350 JPY for everything\n\n4. Okinawan Izakaya at Urizun: https://goo.gl/maps/iwbuKjfUUG1yxNNK7 - In order get a taste of traditional Okinawan food, we went to Urizun. Again, dishes were totally different from anywhere else I’ve bee.\nPrice - 9,353 JPY for everything\n\n5. Goat Sashimi at Nijuban (20th) Goat Restaurant: https://goo.gl/maps/UwNcUyueA6eVYKBw7 - Finally there was one meal I was not going to leave Okinawa without trying - goat sashimi!\nPrice - 3,400 JPY for everything\n\nOkinawa is a wonderful island to visit with a truly unique food culture. Thank you for watching this Okinawan food tour!\n\nSocial Media:\nFacebook: https://www.facebook.com/markwiensfoodvideos \nInstagram: https://www.instagram.com/migrationology/ \nTiktok: https://www.tiktok.com/@markwiens \n\n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ\n🎥 Camera gear I use: https://amzn.to/3FVdBUd \n(some of these are Amazon affiliate links)', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/FwetMQ3G0xs/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/FwetMQ3G0xs/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/FwetMQ3G0xs/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/FwetMQ3G0xs/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/FwetMQ3G0xs/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-05-23 13:00:10'),
(64, 'youtube#playlistItem', 'sTG-Gl4gLAE', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'Giant GREEN ALIEN Shell!! Sashimi + EXOTIC SEAFOOD in Okinawa, Japan!', '🇯🇵 Japanese Street Food Tour: https://youtu.be/0II-qU0ADr4\n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ \n\nNAHA, OKINAWA - We’re on the island of Okinawa in southern Japan, and Okinawa is famous for its incredible seafood. Due to being further south, the seafood selection is totally different from what you’d find in northern parts of Japan, here it’s much more tropical.\n\nToday we’re heading straight to the Makishi Public Market (https://goo.gl/maps/pEMxXv49G8NuM7899), an absolute seafood wonderland where you will see a full aquarium of different seafood available and an amazing colorful selection. After walking around for a few minutes we then decided on a very friendly couple who had a fantastic fresh catch. We bought a giant slipper lobster (biggest I’ve ever seen), a huge green turban shell, and a red grouper.\nTotal price - 31,680 JPY for everything\n\nUpstairs you can eat all your fresh seafood at a restaurant where they will prepare it for you.\nPrice - 2,650 JPY for cooking and side dishes\n\nWhen you’re in Okinawa, visiting the Makishi Public Market for a seafood meal is a must!\n\nThanks to my friend Yuji-San for taking me about Naha: https://www.instagram.com/hotel_manager_jt/ \n\nSocial Media:\nFacebook: https://www.facebook.com/markwiensfoodvideos \nInstagram: https://www.instagram.com/migrationology/ \nTiktok: https://www.tiktok.com/@markwiens \n\n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ\n🎥 Camera gear I use: https://amzn.to/3FVdBUd \n(some of these are Amazon affiliate links)', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/sTG-Gl4gLAE/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/sTG-Gl4gLAE/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/sTG-Gl4gLAE/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/sTG-Gl4gLAE/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/sTG-Gl4gLAE/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-05-19 13:00:45'),
(65, 'youtube#playlistItem', 'VAkFFjaencA', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'Unique WHOLE DUCK Barbecue!! 🇻🇳 Vietnamese Food in Rural Village, Ha Giang!!', '🇻🇳 Vietnamese Street Food Tour: https://youtu.be/Wc_F_BesIT0\n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ\n\nHA GIANG VIETNAM - Welcome to Ha Giang, in the mountains of northern Vietnam, on the border of China. Today we’re with Mr. Thien at his homestay where he and his family will be cooking a full Tay People festival meal - including a five colored sticky rice, a whole duck, a whole pig, and a fish.\n\nA big thank you to YESD Travel Vietnam for making this happen: https://yesd.org/ Highly recommended for authentic and responsible tours in Vietnam.\n\nWhen we arrived they were already beginning the meal preparations. We were lucky to see the entire cooking process from start to finish. One of the traditional foods of the Tay People is five colored sticky rice, each color made from a natural coloring and steamed. Along with the sticky rice we had a huge assortment of pork dishes, including fresh blood and organ sausage, boiled meat, grilled meat, and probably my favorite of the meal - roasted duck stuffed with Kumquat leaves.\n\nWhen the food was ready, they presented it on trays over banana leaves with a chili dipping sauce. Food in Northern Vietnam is not only about eating, but it’s about socializing, talking, drinking, and eating together. \n\nSocial Media:\nFacebook: https://www.facebook.com/markwiensfoodvideos \nInstagram: https://www.instagram.com/migrationology/ \nTiktok: https://www.tiktok.com/@markwiens \n\n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ\n🎥 Camera gear I use: https://amzn.to/3FVdBUd \n(some of these are Amazon affiliate links)\n\n🇹🇭 Bangkok Food Tour Available now: https://bangkokvanguards.com/experiences-2/the-ultimate-bangkok-foodtour/ \n\n🔔 Subscribe: Thank you for watching this street food tour, remember to Subscribe: https://www.youtube.com/@MarkWiens for more food and travel!', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/VAkFFjaencA/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/VAkFFjaencA/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/VAkFFjaencA/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/VAkFFjaencA/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/VAkFFjaencA/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-05-13 13:00:18'),
(66, 'youtube#playlistItem', 'Wc_F_BesIT0', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'EXTREME Vietnamese Street Food - 5 Must Eat Foods in Hanoi!!', '🇻🇳 Vietnam Street Food - Ultimate Pho Tour: https://youtu.be/Feu-DN-UleE\n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ\n\nHANOI, VIETNAM - Today we’re going on an ultimate Vietnamese street food tour to eat 5 of the must eat Vietnamese foods in Hanoi, that are not pho. I’m hanging out with local food expert @Hanoifood from Hanoi Food. We’re eating some local favorite Vietnamese dishes and some extreme dishes as well. It’s going to be delicious!\n\nThank you to @Hanoifood for taking me on this amazing Hanoi street food tour: \n\nHere are all the places we ate:\n\n1. Xôi Xéo\nLocation: Xôi Mây (https://goo.gl/maps/LWXB1Q6ComQP4pXaA) \nPrice: 15,000 VND ($0.63) per bowl \nOne of the common breakfasts in northern Vietnam is sticky rice with toppings. She has to be one of the fastest food assemblers in all of Vietnam!\n\n2. Bún Riêu \nLocation: Bún riêu Hàng Lược (https://goo.gl/maps/WbUu189N5ihHDKDP9) \nPrice: 75,000 VND ($3.15) for fully loaded bowl \nPho is extremely common in Vietnam, but there are so many other noodle soups, and bun rieu is one of the best. This place is extremely popular and we ordered it fully loaded!\n\n3. Bún Chả \nBún Chả Hàng Quạt (https://goo.gl/maps/QJqbDn8X6miUBKzE9) \nPrice: 45,000 VND ($1.89) per portion \nIf there’s one dish that you have to eat when you’re in Hanoi, Vietnam, it would be bun cha for lunch. The combination of grilled pork in a soup of fish sauce with noodles and vegetables is heavenly.\n\n4. Bún ốc\nLocation: Bún ốc cô Huệ (https://goo.gl/maps/uVRbstsbXmLntvdU8) \nPrice: 40,000 VND ($1.68) per bowl \nOne of Khoa’s favorite local dishes is bun oc, or snails and noodles. We specifically tried the cold version with giant snails!\n \n5. Cháo\nLocation: Cháo Sườn Sụn Huyền Anh Đồng Xuân (https://goo.gl/maps/FJhqyLWhaqjo7xhP9) \nPrice: 35,000 VND ($1.47) per bowl \nAnother common dish in Vietnam is chao, or congee, rice porridge. Rather than being chunk with rice grains, this was one of the smoothest bowls of congee ever.\n\n6. Chả Rươi\nLocation: Cửa Hàng Chả Rươi Hưng Thịnh (https://goo.gl/maps/899cEgbVrh8xhXZK8) \nPrice: 35,000 VND ($1.47) per piece, we ate 5 \nOne more extreme Vietnamese food we had to try was cha ruoi, a sandworm pancake. A little bizarre, but proved to be one of the best meals of the day!\n\nThank you for watching this ultimate Vietnamese street food tour in Hanoi!\n\nSocial Media:\nFacebook: https://www.facebook.com/markwiensfoodvideos \nInstagram: https://www.instagram.com/migrationology/ \nTiktok: https://www.tiktok.com/@markwiens \n\n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ\n🎥 Camera gear I use: https://amzn.to/3FVdBUd \n(some of these are Amazon affiliate links)\n\n🇹🇭 Bangkok Food Tour Available now: https://bangkokvanguards.com/experiences-2/the-ultimate-bangkok-foodtour/ \n\n🔔 Subscribe: Thank you for watching this street food tour, remember to Subscribe: https://www.youtube.com/@MarkWiens for more food and travel!', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/Wc_F_BesIT0/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/Wc_F_BesIT0/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/Wc_F_BesIT0/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/Wc_F_BesIT0/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/Wc_F_BesIT0/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-05-09 13:00:33'),
(67, 'youtube#playlistItem', 'Feu-DN-UleE', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'Vietnam Street Food - ULTIMATE PHO TOUR!! (How Pho Became World’s #1 Vietnamese Food)', '🍜 Bangkok Chinatown - 5 Best Foods: https://youtu.be/WRLVrfIBS1k\n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili - Available Now: https://amzn.to/3PNTvNQ\n\nHANOI, VIETNAM: Welcome to Hanoi, Vietnam, the capital of the most well known Vietnamese food around the world - pho! Today I’m hanging out with my friend Khoa from @Hanoifood and we’re taking you on an unforgettable pho tour of Hanoi. We’ll be eating at 5 of the best pho restaurants and stalls in Hanoi, and sharing with you the history of how pho came about and how it took over the world as the most famous of all Vietnamese food.\n\nHuge thanks to Khoa: @Hanoifood \n\nHere are all the pho spots we ate at in this video:\n\n1. Phở Mạnh Cường (https://goo.gl/maps/MLh55yK9cy1x2gaKA) \nPrice: 55,000 VND ($2.31) per bowl\nWe’re starting off with a simple bowl of pho, but very popular for breakfast in Hanoi.\n\n2. Pho Thin (https://goo.gl/maps/LM5viiFn85xSBhcNA) \nPrice: 70,000 VND ($2.94) per bowl \nThis is one of the most famous bowls of pho in Hanoi, and they even have restaurants abroad. One of their signatures is that they stir fry the beef instead of boiling it. It’s not doubt one of the best bowls of pho you’ll ever eat.\n\n3. Phở Bò Ấu Triệu (https://goo.gl/maps/iGbqejrNy3dAnYsA8) \nPrice: 60,000 VND ($2.52) per bowl \nAnother bowl of extraordinary beef pho, this was one of my favorites of the day.\n\n4. Phở gà Phương (https://goo.gl/maps/Wckk9d85ZHRUna7X8) \nPrice: 100,000 VND ($4.20) for full toppings \nAlong with beef, chicken pho has a unique history and Khoa takes me to one of his favorite places - this place is outstanding!\n\n5. Phở Hạnh (https://goo.gl/maps/ukmNLSRyY5gGAnpm9) \nPrice: 50,000 VND ($2.10) per bowl, 80,000 VND (3.36) salad \nTo wrap up this ultimate Vietnamese street food pho tour we tried one more bowl of chicken pho - but this time a dry version with soup on the side. Additionally the cabbage chicken salad was life-changing.\n\nThank you for watching this ultimate Vietnamese street food tour in Hanoi!\n\nSocial Media:\nFacebook: https://www.facebook.com/markwiensfoodvideos \nInstagram: https://www.instagram.com/migrationology/ \nTiktok: https://www.tiktok.com/@markwiens \n\n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ\n🎥 Camera gear I use: https://amzn.to/3FVdBUd \n(some of these are Amazon affiliate links)\n\n🇹🇭 Bangkok Food Tour Available now: https://bangkokvanguards.com/experiences-2/the-ultimate-bangkok-foodtour/ \n\n🔔 Subscribe: Thank you for watching this street food tour, remember to Subscribe: https://www.youtube.com/@MarkWiens for more food and travel!', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/Feu-DN-UleE/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/Feu-DN-UleE/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/Feu-DN-UleE/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/Feu-DN-UleE/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/Feu-DN-UleE/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-05-06 13:00:12'),
(68, 'youtube#playlistItem', 'Q2bfJ9ivMZ0', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'Can\'t believe the juiciness! 🍗 Thai fried chicken in Hat Yai!', 'Welcome to the fried chicken capital of Thailand - Hat Yai (หาดใหญ่)! We\'re going to one of the best Thai street food stalls for fried chicken in all of Thailand, and the world. The chicken is deep fried until golden crispy, and so juicy on the inside. One of the highlights is also when you eat it with hot fresh sticky rice and crispy shallots. Thai fried chicken heaven!\n\n📍 Sofeeya Fried Chicken (ไก่ทอดซอฟียา), Hat Yai, Thailand', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/Q2bfJ9ivMZ0/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/Q2bfJ9ivMZ0/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/Q2bfJ9ivMZ0/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/Q2bfJ9ivMZ0/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/Q2bfJ9ivMZ0/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-05-03 12:00:25');
