(69, 'youtube#playlistItem', 'q7t2Sac93Pw', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', '7 AM Thai Street Food Tour!! BREAKFAST HEAVEN in Bangkok, Thailand!!', '🇹🇭 Bangkok Chinatown - 5 Best Foods: https://youtu.be/WRLVrfIBS1k\n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ\n\nYAOWARAT, BANGKOK - We’re in Yaowarat, Bangkok’s Chinatown to eat some of the off-the-beaten path, yet extremely iconic Chinese Thai street foods! We’re starting early in the morning at 7 am to eat some extremely popular Thai street food. We’re in for some seriously good food!\n\nHere are all the places we ate:\n\n1. Nai Uu Pork Leg Stew (ขาหมูนายอุ๊ พลับพลาไชย): https://goo.gl/maps/HJTLu5EkNAvamFaz6 - This legendary restaurant only opens from about 6 am to 9 am and they serve one of Bangkok’s best Braised Pork Leg (ข้าวขาหมู).\nPrice: 50 THB ($1.45) per plate\n\n2. Plaeng Nam Chicken Rice (ข้าวมันไก่แปลงนาม): https://goo.gl/maps/rTcgMcGz5z3814kq6 - Located right in the heart of Yaowrat, they serve is a delicious and traditional plate of Hainanese chicken rice ​​(ข้าวมันไก่).\nPrice: 80 THB ($2.32) per plate\n\n3. Ao Roasted Pork (ร้านข้าวหมูแดง นายโอว): https://goo.gl/maps/UJBZXZVNG51LUHbm8 - Next up on this Thai street food tour we’re eating Red Pork Rice (ข้าวหมูแดง) served for this generations old stall. Their crispy pork belly is outstanding and the pour their signature sauce over the rice in alcohol bottles.\nPrice: 60 THB ($1.74) per big plate\n\n4. Chua Hah Seng (ฉั่วฮะเซ้ง ห่านพะโล้): https://goo.gl/maps/5DSfYbaxmydKiNjD7 - Off the beaten path, this generations old restaurant specializes in Braised Goose (ห่านพะโล้), and it’s absolutely delicious.\nPrice: 310 THB ($9.00) total\n\nThank you for watching this Thai street food tour!\n\nSocial Media:\nFacebook: https://www.facebook.com/markwiensfoodvideos \nInstagram: https://www.instagram.com/migrationology/ \nTiktok: https://www.tiktok.com/@markwiens \n\n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ\n🎥 Camera gear I use: https://amzn.to/3FVdBUd \n(some of these are Amazon affiliate links)\n\n🇹🇭 Bangkok Food Tour Available now: https://bangkokvanguards.com/experiences-2/the-ultimate-bangkok-foodtour/ \n\n🔔 Subscribe: Thank you for watching this street food tour, remember to Subscribe: https://www.youtube.com/@MarkWiens for more food and travel!', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/q7t2Sac93Pw/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/q7t2Sac93Pw/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/q7t2Sac93Pw/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/q7t2Sac93Pw/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/q7t2Sac93Pw/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-04-29 13:00:41'),
(70, 'youtube#playlistItem', 'MmW1g5ApLXQ', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'Bangkok Street Food - $2 SPICY SQUID!! | Real Local Thai Food!', '🇹🇭 Bangkok Chinatown - 5 Best Foods: https://youtu.be/WRLVrfIBS1k\n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ\n\nBANGKOK, THAILAND - Today in Bangkok, Thailand we’re going on a Thai street food tour to eat at some street food stalls that are very popular with tuk tuk drivers, taxi drivers, and motorbike delivery drivers. We’ll be walking our way about Wong Wian Yai to taste some incredibly delicious and fresh Thai street food!\n\nHere’s where I ate:\n\n1. Ba Meow Boiled Beef (ร้านต้มเนื้อป๋าเหมี่ยว): https://goo.gl/maps/j7nt1v4nUiQZYYJb7 - We started this Thai street food tour with a boil of delicious Boiled Beef (ต้มเนื้อ). It sounds simple, but it’s boiled with Thai herbs and seasoning, and as their customers tell you, it’s extremely clean tasting - that’s the secret. Along with herbs and sauce, it is spectacular.\nPrice: 120 THB ($3.52) for big bowl\n\n2. Yim Ahaan Dtam Sang (ยิ้ม อาหารตามสั่ง) - Not far from Wong Wiang Yai market you’ll find this small street food stall that’s popular at lunch for Thai stir fried dishes. I ordered Squid Kaprao (กะเพราปลาหมึก), which was spicy and delicious - cooked on spot!\nPrice: 70 THB ($2.05) for my plate\n\n3. Laap Ba Lek (ร้านลาบ (ป้าเล็ก): https://goo.gl/maps/FifML39tbpYKkG8c9 - We next went to a place that’s extremely popular with local taxi drivers and delivery drivers in the area to eat Isaan meat dishes. This place is fantastic and they specialize in fresh beef dishes like Laap (ลาบ).\nTotal price: 300 THB ($8.79) for everything \n\nThank you for watching this Thai street food tour!\n\nSocial Media:\nFacebook: https://www.facebook.com/markwiensfoodvideos \nInstagram: https://www.instagram.com/migrationology/ \nTiktok: https://www.tiktok.com/@markwiens \n\n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ\n🎥 Camera gear I use: https://amzn.to/3FVdBUd \n(some of these are Amazon affiliate links)\n\n🇹🇭 Bangkok Food Tour Available now: https://bangkokvanguards.com/experiences-2/the-ultimate-bangkok-foodtour/ \n\n🔔 Subscribe: Thank you for watching this street food tour, remember to Subscribe: https://www.youtube.com/@MarkWiens for more food and travel!', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/MmW1g5ApLXQ/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/MmW1g5ApLXQ/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/MmW1g5ApLXQ/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/MmW1g5ApLXQ/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/MmW1g5ApLXQ/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-04-25 13:00:26'),
(71, 'youtube#playlistItem', 'WRLVrfIBS1k', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'Thai Street Food - 5 MUST EAT Foods in Chinatown, Bangkok!! (Local Favorites Only!)', '🇹🇭 Late Night Thai Street Food Tour: https://youtu.be/XxDTDCfXgEw \n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ\n\nBANGKOK, THAILAND - Welcome to Bangkok, a paradise of Thai street food. Today we’re exploring Bangkok’s Chinatown, known as Yaowarat, to eat the 5 best Thai Chinese foods - dishes you don’t want to miss!\n\nHere’s all the Thai street food we ate in this video:\n\n#1 Kuay Jab (ก๋วยจั๊บ)\nLocation: Tu Kway Chap ก๋วยจั๊บเฮียตุ๊ แปลงนาม สูตร100ปี (https://goo.gl/maps/3UMKSJB9ycAYoJnV6) - This place is really old school, tucked within a market and they only open a few days per week for breakfast. That being said there are some legendary kuay jab street food stalls on the main Yaowarat road during the evening.\nPrice - 50 THB ($1.43) per bowl\n\n#2 Yellow Curry (แกงกะหรี่)\nLocation: Khao Gaeng Hia Hee (ร้านข้าวแกงคลองถม (เฮียฮี้) (https://goo.gl/maps/iv13VGkFzVZ2Xnuf8) - This Thai Chinese curry hotspot specializes in rice and curry and especially a yellow with beef tendon boiled for six hours.\nPrice - 50 THB ($1.43) per plate\n\n#3 Fishball Noodles (ก๋วยเตี๋ยวลูกชิ้นปลา)\nLocation: Jeng Kung Fish Ball Noodle (ก๋วยเตี๋ยวลูกชิ้นปลาเจงคุง) (https://goo.gl/maps/H8DrqaS4jKpEQ6n7A) - One of the many popular noodles of Bangkok’s Chinatown is fishball noodles and this is one of the best places to try it.\nPrice - 60 THB per bowl\n\n#4 Oyster Omelet (หอยทอด)\nLocation: Wang Hoy Tod (เว้งหอยทอด) (https://goo.gl/maps/GtzdYNv7bZWPn2d97) - Talk about a food legend, he’s been cooking Thai Chinese fried oyster omelettes for over 60 years!\nPrice: 60 THB ($1.72) per plate\n\n#5 Roast Suckling Pig (หมูหัน)\nLocation: Tang Jai Yoo Restaurant (ภัตตาคารตั้งใจอยู่) (https://goo.gl/maps/v6zf6LnVQqMpVipk6) - Finally to complete this Yaowarat tour, we’re going to Tang Jai Yoo Restaurant (ภัตตาคารตั้งใจอยู่), a restaurant that’s been open for over 100 years and specializes in Teochow food, known for their extremely crispy roast suckling pig!\nPrice: 4,040 THB ($115.69) for everything\n\nThank you for watching this Thai food tour!\n\nSocial Media:\nFacebook: https://www.facebook.com/markwiensfoodvideos \nInstagram: https://www.instagram.com/migrationology/ \nTiktok: https://www.tiktok.com/@markwiens \n\n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ\n🎥 Camera gear I use: https://amzn.to/3FVdBUd \n(some of these are Amazon affiliate links)\n\n🇹🇭 Bangkok Food Tour Available now: https://bangkokvanguards.com/experiences-2/the-ultimate-bangkok-foodtour/ \n\n🔔 Subscribe: Thank you for watching this street food tour, remember to Subscribe: https://www.youtube.com/@MarkWiens for more food and travel!', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/WRLVrfIBS1k/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/WRLVrfIBS1k/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/WRLVrfIBS1k/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/WRLVrfIBS1k/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/WRLVrfIBS1k/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-04-22 13:00:30'),
(72, 'youtube#playlistItem', '0EFQ2NU73uU', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'Street Food VS. Luxury HOT POT - One Is So Much Better!! | Taiwan’s HOT POT Obsession!!', '🇹🇼 Ultimate Taiwan Street Food Tour: https://youtu.be/ScnAiHZRcL8 \n🌶 Mark Wiens - Ghost Chili: https://amzn.to/3PNTvNQ \n👕 T-shirts: https://store.migrationology.com/ \n\nTaiwan is undoubtedly obsessed with hot pot! Welcome to Taichung, Taiwan, and today we’re going on a Taiwanese hot pot tour, but two totally different styles - one that’s on the luxury modern trendy side, and the other is a street food legend. We’ll compare the atmosphere, the ingredients, and then of course the prices. Let’s go eat Taiwan hot pot!\n\nKing of Hot Pot (嗑肉石鍋-南屯豐樂店): https://goo.gl/maps/D2DfaEKhanHgiShW7 - The first place is a modern trendy hot pot with a hilarious bleacher platter of beef and meats. The flavor was honestly a little underwhelming, just not enough flavor in the broth. Ingredients were alright.\nTotal price - 1805 TWD ($59.70) \n\nTaiwan Chen Hot Pot (台灣陳沙茶火鍋): https://goo.gl/maps/kAUhCZ8d4GiDNehf7 - This places is an alley street food legend in Taichung and their hot pot was outstanding, including the ingredients, and sauces. I especially loved their local Taiwan beef.\nTotal price - 2,000 TWD ($66.14)\n\nOddly enough, the street food hot pot turned out to be slightly more expensive than the trendy place!\n\nAnd which place did I like better… you probably can tell Taiwan Chen Hot Pot (台灣陳沙茶火鍋)!\n\nSocial Media:\nFacebook: https://www.facebook.com/markwiensfoodvideos \nInstagram: https://www.instagram.com/migrationology/ \nTiktok: https://www.tiktok.com/@markwiens \n\n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ\n🎥 Camera gear I use: https://amzn.to/3FVdBUd \n(some of these are Amazon affiliate links)\n\n🔔 Subscribe: Thank you for watching this street food tour, remember to Subscribe: https://www.youtube.com/@MarkWiens for more food and travel!', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/0EFQ2NU73uU/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/0EFQ2NU73uU/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/0EFQ2NU73uU/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/0EFQ2NU73uU/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/0EFQ2NU73uU/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-04-18 13:00:00'),
(73, 'youtube#playlistItem', 'SSQdmrgWnLo', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'Taiwan Night Market STREET FOOD TOUR!! 🇹🇼 Visit This Market When You’re in Taiwan!', '🇹🇼 Ultimate Taiwan Street Food Tour: https://youtu.be/ScnAiHZRcL8 \n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili Powder: https://amzn.to/3PNTvNQ (Amazon affiliate link)\n\nTAIPEI, TAIWAN - Taiwan is extremely famous for their night market street food culture, and so tonight we’re eating our way through Nanjichang Night Market (南機場夜市) - a lesser known, yet extremely popular local night market. If you want an off the beaten path, guaranteed delicious Taiwanese food experience, this is a great Taipei night market to visit.\n\nOne of the greatest things about Nanjichang Night Market (南機場夜市) is that it’s not only a night market, but it’s open throughout the day and you’ll find different food available depending on the time of the day. Additionally, about 3 or 4 different stalls at this market have been featured in the Michelin Guide Taiwan.\n\nHere’s everything I ate:\n\nSticky Rice Restaurant 曉迪筒仔米糕: https://goo.gl/maps/sPHDpyumST9ZKZeYA \nTotal price - 290 TWD ($9.57)\n\nFried Oyster Ball 好佳蚵嗲: https://goo.gl/maps/ChgAjXxYeJ5jQ75B6 \nTotal price - 160 TWD ($5.29)\n\nSmelly Tofu Boss (臭老闆現蒸臭豆腐-本店): https://goo.gl/maps/oPXNcsyiL8mCimtL9 \nTotal price - 135 TWD ($4.46)\n\nUnnamed Clay Oven Rolls (無名手推車燒餅): https://goo.gl/maps/d7gUXt9NgVZfkAHN6 \nPrice - 15 TWD ($0.50) per piece\n\nA Nan Sesame Oil Chicken (阿男麻油雞): https://goo.gl/maps/w97bXVkR2jwy7iMY9 \nPrice - 215 TWD ($7.11)\n\nTaiwanese Burrito at Wu Wang Tsai Chi (吾旺再季 潤餅捲專賣(原松青潤餅): https://goo.gl/maps/9f3AibdcXd9gcmA86 \nPrice - 60 TWD ($1.98) \n\nHighly recommended for an off the beaten path Taiwan street food night market in Taipei.\n\nSocial Media:\nFacebook: https://www.facebook.com/markwiensfoodvideos \nInstagram: https://www.instagram.com/migrationology/ \nTiktok: https://www.tiktok.com/@markwiens \n\n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ\n🎥 Camera gear I use: https://amzn.to/3FVdBUd \n(some of these are Amazon affiliate links)\n\n🔔 Subscribe: Thank you for watching this street food tour, remember to Subscribe: https://www.youtube.com/@MarkWiens for more food and travel!', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/SSQdmrgWnLo/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/SSQdmrgWnLo/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/SSQdmrgWnLo/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/SSQdmrgWnLo/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/SSQdmrgWnLo/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-04-15 13:00:30'),
(74, 'youtube#playlistItem', 'H5ODOLXDapA', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'Extremely Popular Taiwanese Food - 40 POTS AT A TIME!! | Best Restaurants in Taipei!', '🇹🇼 Ultimate Taiwan Street Food Tour: https://youtu.be/ScnAiHZRcL8 \n🎥 Camera gear I use: https://amzn.to/3FVdBUd \n(some of these are Amazon affiliate links)\n\nTaiwan is a food lovers paradise and today we’re going to two places, one that serves a luxurious chicken soup that’s been boiled for over 12 hours and another that serves a local Taiwanese ginger duck hot pot. It’s going to be a delicious food tour in Taipei!\n\nHere are the places I ate in this video:\n\nChicken soup at Ji Yuan Restaurant 驥園川菜餐廳 (https://goo.gl/maps/AsvUFdj6JSnZeztJ7) - This restaurant is legendary - make sure you make reservations and pre-book your giant chicken soup - it’s insanely tasty!\nTotal price - 3,780 TWD ($124.96)\n\nSteamed Bun Shop (寧波生煎包): https://goo.gl/maps/iERUVJ5aY9zV8DZp6 - Can’t go wrong with these legendary Shanghainese fried buns.\n\nGinger Duck Hot Pot (鴨味仔紅面薑母鴨 松江店): https://goo.gl/maps/Kh1PUeJUbRTFnUuWA - This is definitely a unique food experience in Taiwan, something that doesn’t always get the spotlight compared to the famous Taiwanese hot pots.\nTotal price - 720 TWD ($23.80)\n\nAll the food on this tour was outstanding, highly recommended when you’re in Taipei, Taiwan!\n\nSocial Media:\nFacebook: https://www.facebook.com/markwiensfoodvideos \nInstagram: https://www.instagram.com/migrationology/ \nTiktok: https://www.tiktok.com/@markwiens \n\n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ\n🎥 Camera gear I use: https://amzn.to/3FVdBUd \n(some of these are Amazon affiliate links)\n\n🔔 Subscribe: Thank you for watching this street food tour, remember to Subscribe: https://www.youtube.com/@MarkWiens for more food and travel!', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/H5ODOLXDapA/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/H5ODOLXDapA/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/H5ODOLXDapA/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/H5ODOLXDapA/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/H5ODOLXDapA/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-04-11 13:00:11'),
(75, 'youtube#playlistItem', 'tGYUl9XoXpU', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', '8 AM Taiwanese Street Food Tour!! 🇹🇼  BREAKFAST BUFFET + Danzai Noodles in Taiwan!!', '🇹🇼 Ultimate Taiwan Street Food Tour: https://youtu.be/ScnAiHZRcL8 \n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili Powder: https://amzn.to/3PNTvNQ (Amazon affiliate link)\n\nTAIPEI, TAIWAN - Taiwan has some of the world’s greatest breakfast traditions and so today we’re going on a Taiwanese street food tour to discover what are some of the best morning foods to eat when you’re in Taipei!\n\nBreakfast 1 (青島豆漿店): https://goo.gl/maps/CCNGjceuLhUG8YALA - We’re starting with the classic Taiwanese breakfast of soy milk and baked pasties, both savory and sweet.\nTotal price - 280 TWD ($9.26) \n\nDanzai Noodles (羅家擔仔麵): https://goo.gl/maps/kvrTL2PGbwSLae6E8 - Danzai noodles have a unique story, and it’s a fantastic noodle dish to try.\nPrice - 40 TWD ($1.32) per bowl\n\nStreet Buffet (台灣古早味-正宗阿偉咖哩飯): https://goo.gl/maps/hqef5FLw5xpn3YcE7 - This is my kind of a Taiwanese breakfast - including curry over rice plus lots of side dishes.\nTotal price - 200 TWD ($6.62)\n\nJia Xing Fish Ball Restaurant (佳興魚丸店): https://goo.gl/maps/RdCkuaeLyGDets9q9 - This was an extra unplanned stop, but they are legendary for their unique stuffed fishballs.\n\nDadaocheng Cisheng Temple: https://goo.gl/maps/g1NQuFBKEn6hgLMYA - This is a Taiwanese food hidden gem in Taipei, within the temple courtyard and a fantastic place to eat and remember the traditional way of live in Taipei.\n\nCongee\nTotal price - 260 TWD ($9.26)\n\nPork rib soup \nTotal price - 170 TWD ($5.62)\n\nChicken roll\nPrice - 70 TWD ($2.32)\n\nPork leg noodles\nTotal price - 130 TWD ($4.30)\n\nThank you very much for watching this Taiwan street food tour!\n\nSocial Media:\nFacebook: https://www.facebook.com/markwiensfoodvideos \nInstagram: https://www.instagram.com/migrationology/ \nTiktok: https://www.tiktok.com/@markwiens \n\n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ\n🎥 Camera gear I use: https://amzn.to/3FVdBUd \n(some of these are Amazon affiliate links)\n\n🔔 Subscribe: Thank you for watching this street food tour, remember to Subscribe: https://www.youtube.com/@MarkWiens for more food and travel!', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/tGYUl9XoXpU/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/tGYUl9XoXpU/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/tGYUl9XoXpU/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/tGYUl9XoXpU/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/tGYUl9XoXpU/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-04-08 13:00:46'),
(76, 'youtube#playlistItem', 'v5tP4z3DurQ', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'King of FRIED RICE - He Cooks 45 Plates at a Time!! | Taiwanese Street Food!!', '🇹🇼 Ultimate Taiwan Street Food Tour: https://youtu.be/ScnAiHZRcL8 \n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili Powder: https://amzn.to/3PNTvNQ (Amazon affiliate link)\n\nTAIPEI, TAIWAN - Welcome again to the island food paradise of Taiwan, and today we’re going on a Taiwanese street food tour but focusing on some of the intense wok fired dishes of Taiwan including the King of Fried Rice!!\n\n1. Market Stir Fry 龍記炒燴: https://goo.gl/maps/G76f2NwgbZsLXrNg8 - First to begin this Taiwanese food tour we stopped off at a market across the street from Taiwan University. At lunch the market transforms into a massive food court with all things Taiwanese food you can imagine. But we headed to the back of the market to go to a famous stir fry stall where they make everything fresh to order. A few of their specialties are fried noodles and egg and beef in a sauce over rice. Food was delicious!\nTotal price - 320 TWD ($10.57)\n\n2. Oyster omelet (廣州街夜市香脆蚵仔煎): https://goo.gl/maps/uneE6Gk9LLE8FduY7 - Next up, another Taiwan street food classic - the oyster omelet. They fry it on a huge iron griddle feeding it lard as they go. One of the unique things about a Taiwanese oyster omelet is that they serve it with a big puddle of miso tomato sauce in the center. Additionally some of the highlights here are the plump poached oysters and the simple ginger soup.\nTotal price - 520 TWD ($17.18)\n\n3. Fried Rice Restaurant (後港一路蛋炒飯): https://goo.gl/maps/XroqUXBp722FQseS8 - But really, the absolute highlight was going to Taiwan’s king of fried rice. As soon as I arrived they started making a batch of 45 plates at a time on one griddle. We got to see the full process as they added in 45 eggs, a bag of shrimp, cabbage, sauce, and kilos of rice. It was an amusement park of fried rice - a mountain of fried rice. And the owners are extremely friendly!\nTotal price - 180 TWD ($5.95)\n\nThis turned out to be an amazing Taiwan street food tour in Taipei. I loved the friendly owners and the delicious taste of the breath of the wok!\n\nSocial Media:\nFacebook: https://www.facebook.com/markwiensfoodvideos \nInstagram: https://www.instagram.com/migrationology/ \nTiktok: https://www.tiktok.com/@markwiens \n\n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ\n🎥 Camera gear I use: https://amzn.to/3FVdBUd \n(some of these are Amazon affiliate links)\n\n🔔 Subscribe: Thank you for watching this street food tour, remember to Subscribe: https://www.youtube.com/@MarkWiens for more food and travel!', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/v5tP4z3DurQ/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/v5tP4z3DurQ/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/v5tP4z3DurQ/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/v5tP4z3DurQ/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/v5tP4z3DurQ/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-04-04 13:00:43'),
(77, 'youtube#playlistItem', 'ScnAiHZRcL8', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'Taiwan Street Food - BEST BEEF NOODLES + 5 Must Eat Foods in Taipei!!', 'Taiwanese Street Food - The Ultimate Tour!\n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili Powder: https://amzn.to/3PNTvNQ (Amazon affiliate link)\n\nTAIPEI, TAIWAN - Welcome to Taiwan! Today we’re going on an ultimate Taiwanese street food tour to eat 5 of the best dishes that you don’t want to miss eating when you’re in Taipei. From beef noodles to scallion pancakes, these are five of the most iconic and delicious foods to try, and where to try them. Let’s eat!\n\n1. Beef Noodles (牛肉麵)\nLocation: Liu Shandong Beef Noodles 劉山東牛肉麵 (https://goo.gl/maps/LcecTVDPrpZ6dcZ99) \nPrice: 160 TWD ($5.28) per bowl\nBeef noodles are perhaps the single most famous of all Taiwanese foods, there are few things better than a giant bowl of thick noodles with a soothing beef bone broth, and Taiwan does it well. Liu Shandong Beef Noodles is one of the legends of Taiwanese beef noodles, old school, and droolworthy. It was an honor to have a kitchen tour with Taiwan’s King of beef noodles!\n\n2. Lu Rou Fan (滷肉飯)\nLocation: Jin Da Lu Rou Fan 今大魯肉飯 (https://goo.gl/maps/3FvJook9MsF2mWbU6) \nTotal price - 170 TWD ($5.62)\nPerhaps the single most iconic and loved dish in Taiwan for Taiwanese people is Lu Rou Fan (滷肉飯), a sauce made from braised pork belly to eat over rice. It has its origins in Taiwan when people needed to take a little meat and stretch the flavor, creating a flavorful gravy. It’s comfort food and something that is dear to the hearts of Taiwanese people.\n\n3. Scallion Pancake (蔥抓餅)\nLocation: Hsiung Chi Scallion Pancake 雄記蔥抓餅 (https://goo.gl/maps/cZKPcMAcZY4WKRkA8)\nPrice - 110 TWD ($3.63) for both\nNext up on this Taiwan street food tour we’re eating scallion pancakes, one of the most popular street food snacks. They pancakes are almost roti style and you can get them with eggs, or full on with egg, cheese, ham, sauces, and extra toppings. It’s fresh, tasty, gooey, and crispy all at the same time.\n\n4. Stinky Tofu (臭豆腐)\nLocation: Dai’s House of Unique Stink 戴記獨臭之家臭豆腐專賣店 (https://goo.gl/maps/DnzcQL5VECrDbfvo8) \nTotal price - 175 TWD ($5.78)\nAh yes, stinky tofu, something your taste buds will never forget! It’s more than a meal, but an experience and something truly to be respected. This place makes all their own stinky tofu and we had the rare opportunity to taste a 2 year old fermented tofu - one of the stronger flavors I’ve ever experienced, WOW!\n\n5. Dumplings (餃子)\nLocation: Dragon Inn Dumpling House 龍門客棧餃子館 (林森店) (https://goo.gl/maps/beZFz3MUVqNazHRE6) \nTotal price - 550 TWD ($18.17)\nFew things make me think about Taiwan and Taiwanese food more than dumplings and braised meats and parts. Dragon Inn serves legendary boiled dumplings and their cabinet of braised items is something truly impressive. What a meal, so good.\n\nSo there you have all five of the must eat dishes when you’re in Taiwan and where to eat them!\n\nThanks to my friend https://www.instagram.com/taipeieats/ for helping me arrange this food tour.\n\nSocial Media:\nFacebook: https://www.facebook.com/markwiensfoodvideos \nInstagram: https://www.instagram.com/migrationology/ \nTiktok: https://www.tiktok.com/@markwiens \n\n👕 T-shirts: https://store.migrationology.com/ \n🌶 Ghost Chili: https://amzn.to/3PNTvNQ\n🎥 Camera gear I use: https://amzn.to/3FVdBUd \n(some of these are Amazon affiliate links)\n\n🔔 Subscribe: Thank you for watching this street food tour, remember to Subscribe: https://www.youtube.com/@MarkWiens for more food and travel!', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/ScnAiHZRcL8/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/ScnAiHZRcL8/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/ScnAiHZRcL8/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/ScnAiHZRcL8/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/ScnAiHZRcL8/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-04-01 13:00:29'),
(78, 'youtube#playlistItem', '4KIwvpSgEP8', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'Extreme Japanese Food!! LOBSTER SASHIMI 🦞 Kaisen Don in Miyazaki!', '🍜 Japan’s Best Beef - Miyazaki A5 Wagyu: https://youtu.be/TfRJal0QLSo\n🎥 Camera gear I use: https://amzn.to/3FVdBUd \n🌶️ Get Smoked Ghost Pepper: https://amzn.to/3PNTvNQ (affiliate link to Amazon)\n\nMIYAZAKI, JAPAN: Miyazaki, located in the southern part of Kyushu island in Japan is extremely famous for its chicken, beef, and seafood - including the prized local spiny lobsters. To today we\'re driving along the coast of Miyzaki to eat some of the ultimate fresher seafood catch - including the freshest ever lobster sashimi and a kaisen don with raw seafood over rice.\n\nLobster sashimi: https://goo.gl/maps/E5A88xiyChpUCQNJ8 - The first place was off the beaten path, a small family run seafood hut on the side of the ocean known for their local lobsters. I chose one of the biggest they had - though not that huge. And in approximately 15 seconds it was lobster sashimi. It was so fresh and so sweet, and the lobster head was made into a delicious miso soup. Highly recommend this amazing little seafood restaurant in Miyazaki.\nPrice - 6,000 JPY ($45.89) total for lobster meal\n\nKaisen don at Taikai: https://goo.gl/maps/Br6rQpHLseWb6n4y6 - Next up we drove just down the road to the next bay along the coast, headed for an extremely famous seafood restaurant known for their lobster and kaizen dons. A kaizen don included rice topped with a medley of fresh seafood, this bowl included almost a dozen different seafood from abalone to fish. It was ultra fresh and pure. Finally we also ordered a big plate of fresh raw sashimi to complete this incredible day of seafood on the coast of Miyazaki, Japan.\nPrice - 2,750 JPY ($21.03) per meal\n\n🎵MUSIC: \nhttps://goo.gl/HwVjdo\n\n——————————————————\n\n📱FOLLOW:\nInstagram: https://instagram.com/migrationology\nFacebook: https://www.facebook.com/migrationology\n\n——————————————————\n\n🌶️ 🌶️🌶️ NEW: Smoked Ghost Pepper Available Now: \nAmazon: https://amzn.to/3PNTvNQ (affiliate link on Amazon in US)\n\n🎥 Camera gear I use: https://amzn.to/3FVdBUd', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/4KIwvpSgEP8/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/4KIwvpSgEP8/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/4KIwvpSgEP8/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/4KIwvpSgEP8/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/4KIwvpSgEP8/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-03-28 13:00:02'),
(79, 'youtube#playlistItem', '2hzdBm0saZU', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'Japanese Food!! $6 ALL YOU CAN EAT 🍜 Udon + Ramen in Fukuoka!!', '🍜 Japanese Street Food in Fukuoka: https://youtu.be/0II-qU0ADr4 \n🌶️ Get Smoked Ghost Pepper: https://amzn.to/3PNTvNQ (affiliate link to Amazon)\n🔔 Subscribe: https://www.youtube.com/@MarkWiens \n\nFUKUOKA, JAPAN - Fukuoka is known throughout Japan for its amazing noodles - from ramen to udon and champon you’ll find some of the most sought after noodles dishes throughout Japan. Today we’re going on a Japanese food tour to try some of the most popular noodles dishes.\n\n#1 Hakata Ramen (Tonkotsu) - There’s no doubt this is one of the most important noodles dishes of Fukuoka, and one of the most famous versions of ramen in Japan - tonkotsu ramen or locally known as Hakata ramen. We went to an old school spot that hasn’t changed in decades. It was one of the best bowls of tonkotsu ramen I’ve ever had.\nHakuryuken https://goo.gl/maps/YiXfVr2Fa78LtFZQ9 \nPrice - 1,150 JPY ($8.68)\n\n#2 Udon - Next up for udon, another Japanese noodle classic. Udon is thick and hearty. We went to a very well known udon restaurant in Fukuoka, and actually you can order from three different sizes, yet they each cost the same amount, and depending on hours (in the afternoon when we came), you can get unlimited re-fills of noodles - so it’s all you can eat udon! I had the hugest bowl possible and it was at least three normal bowls of udon. I was pretty full after eating it all so I didn’t need more!\nShungetsuan Shotenjimae: https://goo.gl/maps/usa7oGeznwikVbb48 \nPrice - 800 JPY ($6.04 all you can eat udon noodles)\n\n#3 Champon - The last dish is champon, especially famous from Nagasaki, south of Fukuoka on Kyushu island. It’s a totally different noodle dish concept where a heap of vegetables are stir fried and then topped like a mountain on top of noodles with thick pork bone broth. It looks huge, but goes down quite easily as it mainly consists of bean sprouts and cabbage.\nIde Champon Odo: https://goo.gl/maps/HLbTzCkbQjQNANhK6 \nPrice - 970 JPY ($7.32)\n\nAll three noodle dishes were fantastic and you don’t want to miss any of them when you’re in Fukuoka, Japan!\n\n🎵MUSIC: \nhttps://goo.gl/HwVjdo\n\n——————————————————\n\n📱FOLLOW:\nInstagram: https://instagram.com/migrationology\nFacebook: https://www.facebook.com/migrationology\n\n——————————————————\n\n🌶️ 🌶️🌶️ NEW: Smoked Ghost Pepper Available Now: \nAmazon: https://amzn.to/3PNTvNQ (affiliate link on Amazon in US)', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/2hzdBm0saZU/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/2hzdBm0saZU/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/2hzdBm0saZU/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/2hzdBm0saZU/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/2hzdBm0saZU/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-03-25 13:00:04'),
(80, 'youtube#playlistItem', 'TfRJal0QLSo', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'The SECRET of Japan’s Best Beef!! 🥩 MIYAZAKI A5 WAGYU - Champion Steak Teppanyaki!!', '🍜 Japanese Street Food in Fukuoka: https://youtu.be/0II-qU0ADr4 \n🌶️ Get Smoked Ghost Pepper: https://amzn.to/3PNTvNQ (affiliate link to Amazon)\n🔔 Subscribe: https://www.youtube.com/@MarkWiens \n\nMIYAZAKI, JAPAN - Welcome to Miyazaki prefecture on the island of Kyushu in Southern Japan! Miyazaki is home to the best Japanese wagyu beef in all of Japan. Today we have the special opportunity to go to a wagyu farm in the mountains and then go to the city to eat at the most well known steak teppanyaki restaurant and sample this award winning Japanese beef!\n\nWe all have heard of Kobe Beef, but in Japan, Miyazaki Wagyu is considered the best beef in the country - and not only considered but they’ve actually won the Japanese Wagyu Olympics! We first drove in the mountains of Miyzaki to a Wagyu ranch where we learned the secret as to why it’s so good - the owner explained that it’s the natural environment - clean air and fresh water that are huge contributors to the quality of beef.\n\nAfter sampling some of their beef ham we then headed to the most famous restaurant in Miyazaki to taste their A5 Miyazaki wagyu steaks at a teppanyaki restaurant.\n\nMiyachiku Beef Teppanyaki: https://goo.gl/maps/z8r2v1F5edy3pE8R6 \n\nI ordered a few of their highest grade steaks and they did a full teppanyaki  show cooking the beef on the hot iron griddle along with bread to soak up the juices. It was an amazing experience, and truly of the best Japanese beef ever!\n\n🎵MUSIC: \nhttps://goo.gl/HwVjdo\n\n——————————————————\n\n📱FOLLOW:\nInstagram: https://instagram.com/migrationology\nFacebook: https://www.facebook.com/migrationology\n\n——————————————————\n\n🌶️ 🌶️🌶️ NEW: Smoked Ghost Pepper Available Now: \nAmazon: https://amzn.to/3PNTvNQ (affiliate link on Amazon in US)', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/TfRJal0QLSo/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/TfRJal0QLSo/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/TfRJal0QLSo/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/TfRJal0QLSo/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/TfRJal0QLSo/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-03-20 13:00:18'),
(81, 'youtube#playlistItem', '1vlsRKEvWaQ', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', '4 Times More Tasty!! JAPANESE FOOD Best Shabu Shabu - Kagoshima Kurobuta!!', '🍜 Japanese Street Food in Fukuoka: https://youtu.be/0II-qU0ADr4 \n🌶️ Get Smoked Ghost Pepper: https://www.kivahealthfood.com/markghostpepper \n🔔 Subscribe: https://www.youtube.com/@MarkWiens \n\nKAGOSHIMA, JAPAN - Welcome to Kagoshima, a prefecture in the Kyushu Island of Japan that’s that’s synonymous with Kagoshima kurobuta - Japan’s premium and most delicious pork - this is the place to eat pork in Japan! Today we’re going on a kurobuta pork food tour, we’ll be eating fried tonkatsu, flash boiled shabu shabu, and an izakaya to end - that’s the plan, get ready for some life changing pork.\n\n4 times tastier than normal pork - I read an article where they actually said Kagoshima kurobuta pigs were 4 times tastier than normal pigs - scientifically proven with their amino acids and makeup. I’m not sure how proven this is, but after tasting it, especially the shabu shabu, I have no reason to think otherwise.\n\nRestaurant 1: Kurobuta: https://goo.gl/maps/6AvMaEq2dFDyHEgN9 - We first headed to Kurobuta restaurant to eat tonkatsu, or a fried pork cutlet, one of Japan’s most famous pork dishes. They had a regular and a black charcoal bread crumb version. Both were excellent and the pork was so juicy and flavorful.\nTotal price - 6,300 JPY for both tonkatsu\n\nRestaurant 2: Shabu Shabu Ichiniisan: https://goo.gl/maps/81r77uiF8gzATNTy9   \nThis was the greatest taste of kurobuta pork possible - shabu shabu - where nothing is covering up the natural taste of the pork. The pork was sliced extremely thin and gently blanched in soba noodle water before being dunked in a very pleasant sauce filled with leeks. It was the highlight of the day.\nTotal price - 7,300 JPY for everything\n\nScene 4: Izakaya Tsuwabuki: https://goo.gl/maps/RNhuicGmuxh94AXY7 \nFinally to complete this Kagoshima pork tour we went to an evening izakaya to try a few more kurobuta pork dishes and a few drinks. It was a fantastic day of kurobuta pork in Kagoshima!\nTotal price - 5,600 JPY\n\n🎵MUSIC: \nhttps://goo.gl/HwVjdo\n\n——————————————————\n\n📱FOLLOW:\nInstagram: https://instagram.com/migrationology\nFacebook: https://www.facebook.com/migrationology\n\n——————————————————\n\n🌶️ 🌶️🌶️ NEW: Smoked Ghost Pepper Available Now: \nDirect: https://www.kivahealthfood.com/markghostpepper \nAmazon: https://amzn.to/3PNTvNQ (affiliate link on Amazon in US)', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/1vlsRKEvWaQ/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/1vlsRKEvWaQ/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/1vlsRKEvWaQ/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/1vlsRKEvWaQ/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/1vlsRKEvWaQ/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-03-18 13:00:01'),
(82, 'youtube#playlistItem', 'PMzfTPgM5pg', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', '300 Year EEL Restaurant!! JAPANESE FOOD - Secret Recipe in Yanagawa, Japan!', '🍜 Japanese Street Food in Fukuoka: https://youtu.be/0II-qU0ADr4 \n🌶️ Get Smoked Ghost Pepper: https://www.kivahealthfood.com/markghostpepper \n🔔 Subscribe: https://www.youtube.com/@MarkWiens \n\nYANAGAWA, JAPAN - Welcome to Yanagawa, located on the island of Kyushu in southern Japan. Today is an extra cold day, snowing and so instead of driving we decided to take the train to get to Yanagawa - from Fukuoka it took about an hour.\n\nYanagawa is a very pleasant town, located along the beautiful Japanese coast, and home to plenty of fresh seafood and something they are most famous for; unagi, or eel. When it comes to Japanese food, Yanagawa is one of the capitals of eel! But first, we took a traditional boat ride through the canal system to enjoy the peace and natural beauty of the town.\n\nEel restaurant 1: Saraya Fukuryu: https://goo.gl/maps/qLu4wLXwkWPTdR4ZA\nWhile on the boat ride, I could smell the smoky aroma of eels being grilled and it was almost unbearable, so we decided to try our first eel - and this was a recommendation from our boat captain. The eel was delicious and fresh, caramelized with a sweet soy sauce glaze, and served over rice in a wooden lacquer box. It was my first taste of Yanagawa eel… but more and better coming up! \nTotal price - 8,150 JPY ($63.48 USD) for 2 boxes\n\nAlien Fish Seafood Shop: https://goo.gl/maps/3d3KwsGX3Ph8VpC17\nNext up we went to a legendary seafood restaurant, more like a seafood market with a restaurant in the back. They had a nice catch, but one of their specialties is alien fish - literally alien fish - something otherworldly which they catch right off the coast of Yanagawa. They recommended some as sashimi and some deep fried. I also tried a number of other dishes, all of which were as fresh as possible and delicious.\nTotal price - 8,800 JPY ($68.54 USD) for everything\n\nMain eel restaurant: Ganso Motoyoshiya: https://goo.gl/maps/xDbBq9d63dvNt2GK8 \nFinally we made it to our main reservation for the main meal of the day and the most highly regarded and renowned Japanese eel restaurant in Yanagawa; Ganso Motoyoshiya. They’ve literally been serving their eel recipe since 1681. I was extremely lucky to have a chance to enter the kitchen to see just how they grill the eels to perfection, dip them into the sauce, grill again, and then place them over rice in a wooden box before steaming it altogether. This style of serving unagi / eel, which is called Unagi no Seiromushi, is unique to Yanagawa and one of the signatures of Ganso Motoyoshiya. I went all out and ordering the biggest set includes 3 types of eel. It was outstanding!\nTotal price - 21,700 JPY ($157.94 USD), but my set cost 8,200 JPY ($59.71 USD)\n\nYanagawa is a fantastic town to visit on a day trip from Fukuoka to enjoy the peace of the canals and especially the delicious Yanagawa eels, and quick alien fish sashimi!\n\nThank you to Visit Kyushu (https://www.visit-kyushu.com/en/) for helping me organize this food tour.\n\n🎵MUSIC: \nhttps://goo.gl/HwVjdo\n\n——————————————————\n\n📱FOLLOW:\nInstagram: https://instagram.com/migrationology\nFacebook: https://www.facebook.com/migrationology\n\n——————————————————\n\n🌶️ 🌶️🌶️ NEW: Smoked Ghost Pepper Available Now: \nDirect: https://www.kivahealthfood.com/markghostpepper \nAmazon: https://amzn.to/3PNTvNQ (affiliate link on Amazon in US)', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/PMzfTPgM5pg/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/PMzfTPgM5pg/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/PMzfTPgM5pg/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/PMzfTPgM5pg/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/PMzfTPgM5pg/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-03-11 13:00:27'),
(83, 'youtube#playlistItem', 'eXjxldwpL5E', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'Record-Breaking ABALONE SASHIMI!! Freshest Japanese Food - Seafood Oyster Huts!!', '🍜 Japanese Street Food in Fukuoka: https://youtu.be/0II-qU0ADr4 \n🌶️ Get Smoked Ghost Pepper: https://www.kivahealthfood.com/markghostpepper \n🔔 Subscribe: https://www.youtube.com/@MarkWiens \n\nFUKUOKA, JAPAN - Welcome to the island of Kyushu, and for winter during the oyster season, oyster huts commonly setup along the coast where you can come and order a bunch of fresh seafood and cook them on a grill table before you. Today, along with oysters, we found a huge abalone, the biggest I’ve ever seen!\n\n1st Oyster Hut: https://goo.gl/maps/fHkqnZiPFkx7FGuD9\nThis is a very popular oyster hut about an hour drive outside of Fukuoka. The sea is so clean and fresh and that’s exactly how the oysters taste. Once you arrive they have a variety of live seafood and especially oysters that you can choose from. Then you go to your table and grill everything. These oysters can be eaten raw or grilled, but most like to grill them. It’s a great Japanese food eating experience especially with family and friends. \nTotal price - 8,100 JPY\n\n2nd Oyster Hut: https://goo.gl/maps/ejt5eDAeDXrqDJiK8\nWe continued with this Japanese oyster hut tour to the second place, which was past Itoshima. This next oyster hut was more a of a local family home where they have opened up their backyard and garage to host seafood loving customers. I immediately loved this place and how family oriented it is - they catch and harvest all their own seafood. When she showed me the giant record-breaking abalone, I immediately had to order it. Grandma came out to slice it perfectly into sashimi and she recommended we eat half of it raw and half of it grilled with some oysters. They even had citrus in the backyard we could use for our oyster meal. It was truly a memorable Japanese food experience! \nTotal price - 9,550 JPY\n\nWhen you visit the island of Kyushu during the winter, visiting a few local oysters huts is a must!\n\nThank you to Visit Kyushu (https://www.visit-kyushu.com/en/) for helping me organize this food tour.\n\n🎵MUSIC: \nhttps://goo.gl/HwVjdo\n\n——————————————————\n\n📱FOLLOW:\nInstagram: https://instagram.com/migrationology\nFacebook: https://www.facebook.com/migrationology\n\n——————————————————\n\n🌶️ 🌶️🌶️ NEW: Smoked Ghost Pepper Available Now: \nDirect: https://www.kivahealthfood.com/markghostpepper \nAmazon: https://amzn.to/3PNTvNQ (affiliate link on Amazon in US)', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/eXjxldwpL5E/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/eXjxldwpL5E/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/eXjxldwpL5E/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/eXjxldwpL5E/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/eXjxldwpL5E/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-03-07 13:00:30');
