(84, 'youtube#playlistItem', '0II-qU0ADr4', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'Japanese Street Food - ORIGINAL FRIED RAMEN + 5 Must Eat Foods in Fukuoka, Japan!!', '🍜 Japanese Food - 4 Times Tastier: https://youtu.be/1vlsRKEvWaQ\n🌶️ Get Smoked Ghost Pepper: https://amzn.to/3PNTvNQ (affiliate link to Amazon) \n🔔 Subscribe: https://www.youtube.com/@MarkWiens \n\nFUKUOKA, JAPAN - Welcome to Fukuoka, on the island of Kyushu, in southern Japan, and this is one of the capitals of Japanese street food in the country. They have done an amazing job to preserve the culture of “yatai” or portable street food stalls that set up in the evening across the city. Tonight we’re going on an ultimate Japanese street food tour in Fukuoka, going to 5 different place for 5 Japanese dishes and I can’t wait to share all the food with you now.\n\n#1 Yaki Ramen\nLocation: Kokinchan: https://goo.gl/maps/AMGdvUadJR6JbFwi6 - We’re starting off with a famous yatai stall where they invented the original yaki ramen - or fried ramen. It was definitely new to me, I thought it would be more of a dry fried noodles, but it was rather a wet and soup fried noodle dish. Amazing, as were the other dishes.\nPrice - 2,650 JPY for everything\n\n#2 Gyoza\nLocation: Yatai Mamichan: https://goo.gl/maps/dwSFjcZea59H947D8 - You can go on a Japanese street food tour without eating gyoza, and Yatai Mamichan is one of the best places to eat them. The chef is amazingly skilling, cooking everything on his own and darting from station to station. Part of the great thing about eating at Yatai is being right in front of the cooking and interacting with the chef.\nPrice - 8,450 JPY for 5 people (we ordered a lot and lots of drinks)\n\n#3 Tempura - Next, I’m not totally sure of the name of this place, but they are known for their tempura, battered and deep fried seafood and vegetables. It was a little oily, but still quite tasty.\nPrice - 1,100 JPY\n\n#4 Hakata Ramen\nLocation: Yatai Kiryu: https://goo.gl/maps/RB5UQkK8wFUG8TTX6 - Hakata ramen, or tonkotsu ramen is one of the most common and popular dishes in Fukuoka and you’ll find Hakata ramen served at nearly all yatai food stalls.\nPrice - 650 JPY per bowl\n\n#5 Yakitori\nLocation: Yatai Kawachan: https://goo.gl/maps/5jzCzVt4VwHJ7hGS7 - Finally we ate at a place called Yatai Kawachan, known for their yakitori, or grilled chicken skewers. It was a quite a selection of different skewers from gizzard to hot dog.\nTotal price - 4,400 JPY for everything with drinks\n\nThe yatai street food culture in Fukuoka is one of the great Japanese food scenes in Japan. Let’s hope generations continue to take pride in their food stalls and preserve the yatai culture.\n\nThank you to Visit Kyushu (https://www.visit-kyushu.com/en/) for helping me organize this food tour.\n\n🎵MUSIC: \nhttps://goo.gl/HwVjdo\n\n——————————————————\n\n📱FOLLOW:\nInstagram: https://instagram.com/migrationology\nFacebook: https://www.facebook.com/migrationology\n\n——————————————————\n\n🌶️ 🌶️🌶️ NEW: Smoked Ghost Pepper Available Now: \nDirect: https://www.kivahealthfood.com/markghostpepper \nAmazon: https://amzn.to/3PNTvNQ (affiliate link on Amazon in US)\n\n🎥 Camera gear I use: https://amzn.to/3FVdBUd', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/0II-qU0ADr4/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/0II-qU0ADr4/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/0II-qU0ADr4/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/0II-qU0ADr4/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/0II-qU0ADr4/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-03-04 13:00:00'),
(85, 'youtube#playlistItem', 'LGJcEj0Gjyc', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'Extreme Hospitality!! SAUDI ARABIAN FOOD on Remote Farasan Islands in the RED SEA!!', '🍗 ALBAIK - Saudi Arabian Fast Food: https://youtu.be/nLR0IxeRveo\n🌶️ Get Smoked Ghost Pepper: https://www.kivahealthfood.com/markghostpepper \n🔔 Subscribe: https://www.youtube.com/@MarkWiens \n\nJIZAN, SAUDI ARABIA - Welcome to the remote Jizan Region of Saudi Arabia, located on the Red Sea, and along the border of Yemen. Today we’re taking a ferry to the Farasan Islands, beautiful Red Sea islands where the people are extremely friendly and the culture is so pure and authentic. We’ll be touring around the island, trying some of the local food, and then the highlight will be a full Farasan Islands seafood meal on the beach - everything home cooked. It’s going to be an incredible day of Red Sea Arabian food, and I can’t wait to share it all with you now!\n\nJazan City - 40 kilometers off the coast of Jazan, Saudi Arabia, within the Red Sea are the Farasan Islands. There are around 80 different islands, home to a just a small population of around 12,000 permanent residents - many of whom still maintain their local traditions. To get there, you take a short 1 hour ferry ride, and when you arrive you can actually feel this sense of relaxation and friendliness when you arrive.\n\nLocal breakfast - we first headed to a local spot to have a quick breakfast of deep fried batter, some a little sweet and some with a little curry powder taste. It was a perfect way to get started. Afterwards to we continued on to the market. Unfortunately the fish auction only takes place in the afternoon, so we weren’t able to see it, but we did meet some very friendly locals and try some of the local Farasan islands melons.\n\nHuge seafood meal - Finally to complete this amazing day in the Farasan Islands, we were invited to a local seafood cookout on the beach to make some of the traditional foods of Farasan Islands; Marsah - mashed banana bread pudding; Sayadiyeh - fish with rice; Megash - sesame oil fish; Helba - fenugreek sauce are just a few of the wonderful dishes. I loved the meal and the atmosphere and our incredible new friends. The food was all fantastic, but I think the highlight was the megash - fish boiled in sesame oil, something truly delicious and something you have to eat when you’re in the Farasan Islands.\n\n🎵MUSIC: \nhttps://goo.gl/HwVjdo\n\n——————————————————\n\n📱FOLLOW:\nInstagram: https://instagram.com/migrationology\nFacebook: https://www.facebook.com/migrationology\n\n——————————————————\n\n🌶️ 🌶️🌶️ NEW: Smoked Ghost Pepper Available Now: \nDirect: https://www.kivahealthfood.com/markghostpepper \nAmazon: https://amzn.to/3PNTvNQ (affiliate link on Amazon in US)', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/LGJcEj0Gjyc/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/LGJcEj0Gjyc/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/LGJcEj0Gjyc/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/LGJcEj0Gjyc/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/LGJcEj0Gjyc/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-02-28 13:00:11'),
(86, 'youtube#playlistItem', 'eH6GoCpq2pI', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'They Serve 1000’s a Day!! BIGGEST SHAWARMA - Middle Eastern Food!!', '🇸🇦 Rare Saudi Arabian Food in Al Hasa: https://youtu.be/MgoO02t7Eg0 \n🌶️ Get Smoked Ghost Pepper: https://www.kivahealthfood.com/markghostpepper \n🔔 Subscribe: https://www.youtube.com/@MarkWiens \n\nRIYADH, SAUDI ARABIA - Welcome to Riyadh, the biggest city in Saudi Arabia and today we’re going on a mixed food tour to eat one of the biggest and most popular shawarma’s in the city, to eat a local family feast, and then to hang out with Hisham who will  cook us the national food of Saudi Arabia!\n\nMama Noura (https://goo.gl/maps/kqd5QEuNQRHvJ4xr8) - Easily one of the most famous restaurants in all of Riyadh is Mama Noura, where they serve what is probably the biggest shawarma in Saudi Arabia, they serve 1000’s and 1000’s of customers everyday. Their main shawarma is made from chicken, marinated perfectly and served in house made bread with garlic sauce and pickles. One of the characteristic differences is that it’s served very small, like sliders, so you can eat many of them. We also tried their juices which are popular as well. This is a must eat when you’re in Saudi Arabia!\n\nHome meal in Riyadh - Next up we we were kindly invited over to the home of Turkey who invited to share a meal with his family. Typically every weekend they gather together to cook and eat. Today, Uncle made his famous mandi, and we also had braised camel. The meal was outstanding, laying over a bed of rice and all of us coming together for the feast. We also sat by the fire, enjoyed each others company and a variety of different snacks and Saudi Arabian delicacies - and of course Saudi coffee and sweet tea. It was truly a remarkable experience and display of genuine hospitality.\n\nKabsa with Hisham - Huge thanks to Hisham: https://www.youtube.com/@misho_baeshen/ - Finally to round up this tour, we headed over to Hisham’s house where he cooked orange kabsa, what is probably the national food of Saudi Arabia and his particular recipe originating from his family in Makkah. It was incredible to learn about all the Arabian spices and ingredients that went into the recipe and then to share the kabsa with Hisham at his house. Thank you Hisaham!\n\nThank you again to https://www.youtube.com/@misho_baeshen/ and to Visit Saudi Arabia for arranging my trip and this incredible experience!\n\n🎵MUSIC: \nhttps://goo.gl/HwVjdo\n\n——————————————————\n\n📱FOLLOW:\nInstagram: https://instagram.com/migrationology\nFacebook: https://www.facebook.com/migrationology\n\n——————————————————\n\n🌶️ 🌶️🌶️ NEW: Smoked Ghost Pepper Available Now: \nDirect: https://www.kivahealthfood.com/markghostpepper \nAmazon: https://amzn.to/3PNTvNQ (affiliate link on Amazon in US)', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/eH6GoCpq2pI/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/eH6GoCpq2pI/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/eH6GoCpq2pI/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/eH6GoCpq2pI/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/eH6GoCpq2pI/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-02-25 13:00:22'),
(87, 'youtube#playlistItem', 'EYaLBsXBuuw', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'Japanese Food - Eating the Original ICHIRAN RAMEN in Fukuoka! #Ramen #Shorts', '#shorts #JapaneseFood #ramen \n\nToday we\'re in Fukuoka, Japan, the capital of ramen and we\'re going to eat at the original Ichiran Ramen headquarters - one of the best and most famous ramen chains in the world. They serve creamy pork bon tonkotsu ramen, and one of the greatest things about Ichiran is being able to customize it exactly the way you like it.\n\nAdditionally, Ichiran is famous for its single booth dining experience. I\'m going to show you the full experience, let\'s go eat Japanese food - Ichiran ramen!\n\nYouTube channel: https://www.youtube.com/@UCyEd6QBSgat5kkC6svyjudA', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/EYaLBsXBuuw/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/EYaLBsXBuuw/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/EYaLBsXBuuw/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/EYaLBsXBuuw/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/EYaLBsXBuuw/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-02-22 11:00:07'),
(88, 'youtube#playlistItem', 'MgoO02t7Eg0', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'Better Than GOLD!! Rare ARABIAN FOOD in World’s Biggest Oasis - 2 Million Palm Trees!', '🇸🇦 World’s Crispiest Lamb: https://youtu.be/0oBpMid_HkU \n🌶️ Get Smoked Ghost Pepper: https://www.kivahealthfood.com/markghostpepper \n🔔 Subscribe: https://www.youtube.com/@MarkWiens \n\nAL HASA OASIS, SAUDI ARABIA - Welcome to Al Hasa Oasis, the world’s biggest oasis, and home to over 2 million palm trees, and endless amount of date palms! It also happens to be home to some very unique and rare Arabian food. Today we’re exploring some fo the local dishes, including Hassawi red rice - considered more precious than gold!\n\nFriend in the video:\nFahad Alshuaibi: https://www.instagram.com/fhadalshuaibi/ - Huge thank you to Fahad for taking me around Al Hasa and for the incredible food and experience!\n\nBreakfast - Before doing anything we started with a champions breakfast in Al Hasa - simmered lamb legs with special bread made with date syrup. Delicious and the perfect way to get started on this Saudi Arabian food tour.\n\nQaisariya Al-Ahsa Sou (https://goo.gl/maps/xVqY55jYUD5u3ahx8) - Al Hasa is extremely well known for its market, where you’ll find everything you need from spices to herbs to clothes to coffee. It’s been a market that’s attracted people from all around the region and traders for centuries. It was fascinating to learn from Fahad about the unique and common ingredients used in Al Hasa cuisine.\n\nRice harvest - We took a quick trip to a farm to see some of the hassawi red rice harvest \nThis can be quite a quick edit to see the hassawi red rice harvest. It’s only grown in the Al Hasa oasis, and it’s one of the world’s most expensive rice grains, and extremely rare. Local consider it more precious than gold, and it has huge nutritional value.\n\nFarm for cooking and eating - The highlight of this experience was going back to the date palm farm where Fahad and friends cooked a huge local meal including the most delicious and rare Al Hasa foods that really showcase the incredible local culture. The spread of food and the variety was astounding - it was one of the best meals I had in Saudi Arabia!\n\nThank you again to Fahad and to Visit Saudi Arabia for arranging my trip and this incredible experience!\n\n🎵MUSIC: \nhttps://goo.gl/HwVjdo\n\n——————————————————\n\n📱FOLLOW:\nInstagram: https://instagram.com/migrationology\nFacebook: https://www.facebook.com/migrationology\n\n——————————————————\n\n🌶️ 🌶️🌶️ NEW: Smoked Ghost Pepper Available Now: \nDirect: https://www.kivahealthfood.com/markghostpepper \nAmazon: https://amzn.to/3PNTvNQ (affiliate link on Amazon in US)', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/MgoO02t7Eg0/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/MgoO02t7Eg0/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/MgoO02t7Eg0/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/MgoO02t7Eg0/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/MgoO02t7Eg0/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-02-18 13:11:55'),
(89, 'youtube#playlistItem', '0oBpMid_HkU', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'World’s CRISPIEST Lamb!! King of MEAT & HONEY in Jeddah, Saudi Arabia!', '🇸🇦 Unseen Saudi Arabian Village Food: https://youtu.be/r2n2tsFiPcc\n🌶️ Get Smoked Ghost Pepper: https://www.kivahealthfood.com/markghostpepper \n🔔 Subscribe: http://bit.ly/MarkWiensSubscribe\n\nJEDDAH, SAUDI ARABIA - Welcome to Jeddah and today we’re going on a food tour, where the main event is going to be a whole lamb roasted for 5 hours over fire, basted with its own oil, and then eaten with honey. An absolutely incredible lamb experience in Saudi Arabia!\n\nThank you to Hisham: https://www.youtube.com/@misho_baeshen/ for taking me around eating in Jeddah!\n\nTo begin the day, there’s nothing better to eat than ful, mashed fava beans, but at this breakfast restaurant in Jeddah they specialize in smoked ful, when some ghee is burned on an onion to give the ful a lovely smokiness.\n\nWe then headed to a nice restaurant to try traditional Jeddah style breakfast, a meal that would typically be eaten on special occasions. The variety and color were beautiful!\n\nHareed Restaurant: https://goo.gl/maps/kAYm2siEUrHvwnDZ6 - Finally on to lunch and the full lamb meal experience. Chef cooked the lamb for 4 - 5 hours over a wood fire, continually rotating it and basting it in lamb oil. It’s the most golden crispy lamb I’ve ever had and eaten dipped into honey. We also tried quite a few other lamb dishes, all the lamb coming from their own farm!\n\nLater in the evening we tried a nostalgic fries stall with all sorts of different sauce that you put on, and my personal favorite - chickpeas!\n\nIt was a great day of food and exploring in Jeddah, Saudi Arabia!\n\nHisham: https://www.youtube.com/@misho_baeshen/\n \nThank you to Visit Saudi Arabia for arranging my food trip to Saudi Arabia!\n\n🎵MUSIC: \nhttps://goo.gl/HwVjdo\n\n——————————————————\n\n📱FOLLOW:\nInstagram: https://instagram.com/migrationology\nFacebook: https://www.facebook.com/migrationology\n\n——————————————————\n\n🌶️ 🌶️🌶️ NEW: Smoked Ghost Pepper Available Now: \nDirect: https://www.kivahealthfood.com/markghostpepper \nAmazon: https://amzn.to/3PNTvNQ (affiliate link on Amazon in US)', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/0oBpMid_HkU/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/0oBpMid_HkU/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/0oBpMid_HkU/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/0oBpMid_HkU/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/0oBpMid_HkU/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-02-14 13:00:02'),
(90, 'youtube#playlistItem', 'r2n2tsFiPcc', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'Unseen SAUDI ARABIA Village Food!! Whole Goat RICE PLATTER in Jazan (Yemen Border)!!', '🇸🇦 Saudi Arabian Food Tour: https://youtu.be/SRFcoqQr2bc\n🌶️ Get Smoked Ghost Pepper: https://www.kivahealthfood.com/markghostpepper \n🔔 Subscribe: http://bit.ly/MarkWiensSubscribe\n\nJAZAN, SAUDI ARABIA: High in the mountains of Saudi Arabia, in the very southwestern corner, on the border of Yemen, is Jazan province. It’s a unique part of Saudi Arabia, where some of the world’s most prized coffee in grown and where the mix of culture and food is unlike other parts of the country. Today we have the privilege to visit a local coffee farm where a local family will be cooking a full goat haneed in the backyard.\n\nWe began our journey from Jizan city, in the Jazan province of Saudi Arabia. The city is located on the Red Sea, yet just an hour drive away to Fayfa, and you’re transported high into the rugged green mountains that are famous for generations of coffee farming.\n\nCoffee is more than just a drink here, it’s a symbol of hospitality and a gesture of welcome. The coffee is much different than your typical Americano - it’s roasted very lightly, and brewed with cardamom and saffron for a unique fragrance. Rather than using sugar, coffee is served black, but with dates so you can alternate between sips of coffee and sweet dates. The combination is perfect.\n\nAfter a welcome and coffee, we lit the outdoor wood fire oven, and then took a tour of the farm to learn about the prized Khawlani coffee beans. The farming practice has been passed down for generations in this area. Along with coffee, there were many medical edible herbs throughout the mountain.\n\nBack to the oven, we loaded up an entire goat, along with big handfuls of sour dough, scented with the aroma green leaves. The oven was closed tight for a couple of hours to seal in all the steam and smoke. This cooking technique is common in Saudi Arabia and really does a great job of smoking, baking, and steaming all at the same time.\n\nThe time finally came, and we dished out all the tender goat on the rice trays. There were also a number of side dishes, including fresh buttermilk served in a smoky wooden bowl, a variety of doughs served with ghee, and possibly the highlight for me; helba, a sudsy fenugreek sauce that’s definitely a unique flavor, and loved in this region.\n\nIt was a meal I’ll never forget, in this friendly coffee village in the mountains of Jazan!\n\nHisham: https://www.youtube.com/@misho_baeshen/\n \nThank you to Visit Saudi Arabia for arranging my food trip to Saudi Arabia!\n\n🎵MUSIC: \nhttps://goo.gl/HwVjdo\n\n——————————————————\n\n📱FOLLOW:\nInstagram: https://instagram.com/migrationology\nFacebook: https://www.facebook.com/migrationology\n\n——————————————————\n\n🌶️ 🌶️🌶️ NEW: Smoked Ghost Pepper Available Now: \nDirect: https://www.kivahealthfood.com/markghostpepper \nAmazon: https://amzn.to/3PNTvNQ (affiliate link on Amazon in US)', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/r2n2tsFiPcc/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/r2n2tsFiPcc/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/r2n2tsFiPcc/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/r2n2tsFiPcc/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/r2n2tsFiPcc/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-02-11 13:00:28'),
(91, 'youtube#playlistItem', 'F-BGeXIUucg', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'Street Food + SEAFOOD in Saudi Arabia!! 🇸🇦 Best RED SEA Fish and Shrimp in Jeddah!!', '🇸🇦 Saudi Arabian Food Tour: https://youtu.be/SRFcoqQr2bc\n🌶️ Get Smoked Ghost Pepper: https://www.kivahealthfood.com/markghostpepper \n🔔 Subscribe: http://bit.ly/MarkWiensSubscribe\n\nJEDDAH, SAUDI ARABIA - Today we’re in the beautiful and historic city of Jeddah, Saudi Arabia, along the Red Sea coast. I’m hanging out with my friend @misho_baeshen and we’ll be going to eat some of the best seafood in the city, exploring the old town of Al-Balad, and finishing with some local favorite foods for dinner.\n\nThanks to Hisham: https://www.youtube.com/@misho_baeshen/\n\nHere are the places we went in this Jeddah food tour: \n\nAl Basali Seafood Restaurant (https://goo.gl/maps/eqv3xRXNys2CzbMB7) - First, the main food mission of the day is to eat some of the best seafood in Jeddah, and so we’re heading to the historical area of Al-Balad to eat at Al Basali Seafood Restaurant that’s been open since 1949, for three generations! They specialize in locally caught seafood from the Red Sea and all seafoods are displayed in a cabinet so you can see what you want to choose. Along with crabs, shrimp and lobster, one of the greatest fish from the Red Sea is a najel fish. The fish was deep fried and seasoned afterwards with a light blend of spices. The entire meal was fantastic, everything fresh, nothing overpowering the delicious seafood. I also really enjoyed the rice, which Hisham mentioned is only eaten when you eat fish.\n\nAl-Balad - Is the historical center of Jeddah and also a  UNESCO World Heritage site. Walking through the narrow streets, it’s truly magnificent to see the preservation of the old town and how it’s still functioning in everyday life. We stopped at a museum and for a quick cup of Saudi coffee while we explored.\n\nOlfat Al Halawani (https://goo.gl/maps/Hp2AGJHYWRsAYwfU7) - Motabbaq is an Arabian food that’s influenced so many similar dishes around the world. To make it, they slap out thin dough, fill it with a combination of herbs, eggs, minced meat, and spices, wrap it up into a packet and cook it over a hot plate. When you eat it, you sprinkle it first with lemon, and chase it with a green chili. It was fantastic, highly recommended, and it’s especially famous to eat in the evening in Jeddah.\n\nLamb head mandi - For one more night snack we stopped at a restaurant to eat lamb head mandi, a dish where the lamb is falling off the bone - quite literally falling off the head - it’s then chopped up and sprinkled with cumin and salt. Each bite melts in your mouth, from the tongue to the cheeks.\n\nJeddah is an incredible city to visit in Saudi Arabia with an exciting food culture!\n\nThank you to Visit Saudi Arabia for arranging my food trip to Saudi Arabia!\n\n🎵MUSIC: \nhttps://goo.gl/HwVjdo\n\n——————————————————\n\n📱FOLLOW:\nInstagram: https://instagram.com/migrationology\nFacebook: https://www.facebook.com/migrationology\n\n——————————————————\n\n🌶️ 🌶️🌶️ NEW: Smoked Ghost Pepper Available Now: \nDirect: https://www.kivahealthfood.com/markghostpepper \nAmazon: https://amzn.to/3PNTvNQ (affiliate link on Amazon in US)', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/F-BGeXIUucg/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/F-BGeXIUucg/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/F-BGeXIUucg/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/F-BGeXIUucg/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/F-BGeXIUucg/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-02-07 13:00:09'),
(92, 'youtube#playlistItem', 'SRFcoqQr2bc', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'The Ultimate SAUDI ARABIAN FOOD Tour in Riyadh!! 5 Best Restaurants You Can\'t Miss!', '🇸🇦 Ultimate Bangladesh Street Food: https://youtu.be/2v_GxYT3Pgw \n🌶️ Get Smoked Ghost Pepper: https://www.kivahealthfood.com/markghostpepper \n🔔 Subscribe: http://bit.ly/MarkWiensSubscribe\n\nRIYADH, SAUDI ARABIA - Welcome to Riyadh, the biggest city in Saudi Arabia and home to diverse people, and some incredibly delicious food. Today I’m taking you on an ultimate local Saudi Arabian food tour of Riyadh, we’ll be eating some of the greatest dishes, food you don’t want to miss!\n\nHere are all the locations featured in this food review:\n\n1. Fawal Abo Salem (https://goo.gl/maps/TyzPpWvigqEM5JcZ6)  - We’re beginning this Saudi Arabian food tour in Riyadh with a staple breakfast - ful - mashed fava beans that likely originate in Egypt, but are widely popular throughout the entire region. Ful medames at Fawal Abo Salem for breakfast is some of the best in the entire city - and I was blown away by the quality and flavor, paired with the freshly baked bread.\n\n2. Camel liver - I’m not totally sure of the name of this place, but they are famous for their fried camel liver, sauteed down with onions and peppers. It’s truly tasty, right off the hot griddle with fresh bread and a dash of hot sauce.\n\n3. Alnaqaa Falafel & Hummus (https://goo.gl/maps/SzCLzQTAteZVUHc76) - To eat the best Falafel and Hummus and Riyadh, you have to go to Alnaqaa - it’s absolutely legendary, and it felt as though I was right back on the streets of Beirut. One of their specialties is a giant falafel stuffed with caramelized onions. And make sure you order the entire falafel mountain!\n\n4. Kebda Restaurant (https://goo.gl/maps/6advt5emgE6eoUfRA) - This Riyadh food tour is not complete with only camel liver - another popular liver to eat is lamb liver, and this time it’s not served on a plate, but with bread, sandwich style. Some of the tastiest lamb liver you’ll ever try!\n\n5. Sudah Restaurant (https://goo.gl/maps/FprxbXE6A4TdMmkdA) - To begin this food tour and to end this food tour, it was a privilege to spend some time at Sudah Restaurant to learn about Haneed, an Arabian food that at this restaurant originates from Aseer Province. They still make it the traditional way, loading parted out young lambs into an underground oven, layered with a specific type of hay that holds in the moisture and gives a distinct fragrance. The result is smokey lamb served over a mountain of rice, that literally melts in your mouth with the smoky fragrance of the hay. It was an unforgettable meal experience in Saudi Arabia!\n\nAnd that wraps up this ultimate Saudi Arabian food tour in Riyadh, what a day of delicious food. \n\nThank you to Visit Saudi Arabia for arranging my food trip to Saudi Arabia!\n\n🎵MUSIC: \nhttps://goo.gl/HwVjdo\n\n——————————————————\n\n📱FOLLOW:\nInstagram: https://instagram.com/migrationology\nFacebook: https://www.facebook.com/migrationology\n\n——————————————————\n\n🌶️ 🌶️🌶️ NEW: Smoked Ghost Pepper Available Now: \nDirect: https://www.kivahealthfood.com/markghostpepper \nAmazon: https://amzn.to/3PNTvNQ (affiliate link on Amazon in US)', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/SRFcoqQr2bc/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/SRFcoqQr2bc/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/SRFcoqQr2bc/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/SRFcoqQr2bc/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/SRFcoqQr2bc/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-02-04 13:00:31'),
(93, 'youtube#playlistItem', '9ADEaeLa024', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'Ancient Inca BBQ - Hot Rocks Pachamanca in Peru’s Andes Mountains!', 'Watch the full video here: https://youtu.be/oo8Uk7o9y_4\n\nHigh in the Andes mountains of Peru, you can still find traditional Pachamanca, the ancient Inca way of cooking meat, potatoes, and vegetables, in a hot rock earth oven. The way they construct a rock dome, blaze a fire, then cook all the ingredients is truly fascinating!\n\nThe alpaca was so tasty and those are easily the best tasting potatoes I\'ve ever had in my life.\n\n#Shorts #Peru #Inca #bbq', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/9ADEaeLa024/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/9ADEaeLa024/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/9ADEaeLa024/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/9ADEaeLa024/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/9ADEaeLa024/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-02-02 12:00:06'),
(94, 'youtube#playlistItem', 'UsHMhIj_IjM', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'Filipino Food EXTREME SEAFOOD!! 🐟 Unbelievable Cooking Skills in Bacolod, Philippines!', '🇵🇭 Philippines Huge Boodle Fight: https://youtu.be/ljViMm9RVDY \n🌶️Get Smoked Ghost Pepper: https://www.kivahealthfood.com/markghostpepper \n🔔 Subscribe: http://bit.ly/MarkWiensSubscribe\n\nBACOLOD, PHILIPPINES - Bacolod is known for its amazing chicken inasal, for it’s giant bone marrow cansi, and finally for its delicious fresh seafood. Today for lunch we’re going to go eat at one of the best Filipino seafood restaurants in Bacolod!\n\nDiotay\'s Eatery (https://goo.gl/maps/GHDJDm5wqZviMjG37) - Welcome to Diotay’s Seafood Eatery, where they have one of the most jaw dropping displays of seafood you can imagine - all the seafood is laid out on ice in the front of the restaurant, from huge fish to giant shells to everything in between. One of the best things is that you can pick and choose whatever seafood you want and you can order it in a variety of different cooking methods and flavors.\n\nWe made sure to get some of their best specialties including grouper head sinigang, adobo squid, flaming hot iron marlin, and garlic shrimp. I was lucky enough to have the chance to go into the kitchen and watch some of the action packed cooking that included series wok fires. The cooking skills were incredible. Also, one of my favorite dishes was the local Bacolod styles sinigang, a sour soup in the Philippines. Again, the broth was made from Batwan fruit (garcinia binucao), a special local fruit.\n\nTotal price - 4,000 PHP ($72.84) for everything\n\nBig thank you to Martin from The Bacolod Food Hunters (https://bacolodfoodhunters.com/) for taking me around on this day of eating in Bacolod, Philippines.\n\n🎵MUSIC: \nhttps://goo.gl/HwVjdo\n\n——————————————————\n\n📱FOLLOW:\nInstagram: https://instagram.com/migrationology\nFacebook: https://www.facebook.com/migrationology\n\n——————————————————\n\n🌶️ 🌶️🌶️ NEW: Smoked Ghost Pepper Available Now: \nDirect: https://www.kivahealthfood.com/markghostpepper \nAmazon: https://amzn.to/3PNTvNQ (affiliate link on Amazon in US)', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/UsHMhIj_IjM/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/UsHMhIj_IjM/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/UsHMhIj_IjM/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/UsHMhIj_IjM/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/UsHMhIj_IjM/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-01-28 13:00:20'),
(95, 'youtube#playlistItem', 'ljViMm9RVDY', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'Boodle Fight!! VILLAGE FOOD in Philippines - Unforgettable Filipino Food!!', '🇵🇭 Philippines Chicken Inasal: https://youtu.be/Ctt0z9Db7-s\n🌶️ Get Smoked Ghost Pepper: https://www.kivahealthfood.com/markghostpepper \n🔔 Subscribe: http://bit.ly/MarkWiensSubscribe\n\nCORDOVA, PHILIPPINES - Today I’m hanging out with my friends @BhenYuri and we’ve been invited over to the @yangcofamilymukbang9627 who make family village food and mukbang videos. They are cooking one of the greatest Filipino food meal experiences you can have - a boodle fight!\n\nCordova is just a short drive from Cebu, yet it’s a totally different world - quiet, relaxing, and still some countryside. The Yangco family has a fantastic property with a farm, vegetables, and even chickens. A boodle fight is a communal style of eating where everyone stands around a table and eats together communally. For this Filipino food boodle fight they are making a couple dishes - a very unique roasted chicken in a tin can wrapped in a banana stalk. Humba bisaya, a braised pork stew that’s one of the favorite dishes of the Visayas, and finally kinalaw - raw fish marinated in vinegar, and this time with grilled pork.\n\nOnce all the dishes were finished cooking we then set the table with everything - the rice on first, all the meat and side dishes, and even fruits around the table. It was an absolute feast, and one of the best Filipino food meals I’ve ever had!\n\nThank you to my friends Bhen and Yuri: \nhttps://www.youtube.com/@BhenYuri \n\nAnd huge thank you to Yangco Family: \nhttps://www.youtube.com/@yangcofamilymukbang9627 \n\n🎵MUSIC: \nhttps://goo.gl/HwVjdo\n\n——————————————————\n\n📱FOLLOW:\nInstagram: https://instagram.com/migrationology\nFacebook: https://www.facebook.com/migrationology\n\n——————————————————\n\n🌶️ 🌶️🌶️ NEW: Smoked Ghost Pepper Available Now: \nDirect: https://www.kivahealthfood.com/markghostpepper \nAmazon: https://amzn.to/3PNTvNQ (affiliate link on Amazon in US)', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/ljViMm9RVDY/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/ljViMm9RVDY/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/ljViMm9RVDY/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/ljViMm9RVDY/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/ljViMm9RVDY/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-01-24 13:00:34'),
(96, 'youtube#playlistItem', 'vAoYf67S5cA', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'Exotic Filipino Street Food - ONLY 80 PER DAY Sell Out Fast!! Rare Delicacy in the Philippines!!', '🌶️ Get Smoked Ghost Pepper: https://www.kivahealthfood.com/markghostpepper (Limited time offer, buy 1 get 1 free)\n🇵🇭 Philippines Chicken Inasal: https://youtu.be/Ctt0z9Db7-s\n🔔 Subscribe: http://bit.ly/MarkWiensSubscribe\n\nCEBU, PHILIPPINES - Hope you’re having a great day! Today we’re in Cebu, Philippines and going with Carlo and some friends to eat at a legendary goat restaurant where they specialize in goat heads. Then after that we’re going to try a few local Cebu street food snacks.\n\nThank you very much to my friend Carlo from @KalamiCebu  always great to hang out, and be sure to follow him for fantastic food recommendations in Cebu, Philippines.\n\nCyria’s Kandingan (https://goo.gl/maps/3Sc9yWsgGTsVtBbF6) - On the outskirts of Cebu is Cyria’s Kandingan, a very popular restaurant that serves all things goat. Along with the kaldereta, which is one of their signature goat stews, the most prized dish they serve are stewed goat heads - and they only serve 80 per day. Everyone I saw orders a mix of dishes, but doesn’t miss the goat head - and they sell out fast!\n\nAfter the amazing goat meal, we continued on this Filipino street food tour with pancakes that are made just outside of a school. The pancakes are served hot and fresh with a little peanut butter on the inside. \n\nFinally to complete this food tour we stopped at the market to try bibingka, a Filipino rice cake cooked in a wood oven.\n\nIt was another fantastic day of Filipino food in Cebu!\n\n🎵MUSIC: \nhttps://goo.gl/HwVjdo\n\n——————————————————\n\n📱FOLLOW:\nInstagram: https://instagram.com/migrationology\nFacebook: https://www.facebook.com/migrationology\n\n——————————————————\n\n🌶️ 🌶️🌶️ NEW: Smoked Ghost Pepper Available Now: \nDirect: https://www.kivahealthfood.com/markghostpepper \nAmazon: https://amzn.to/3PNTvNQ (affiliate link on Amazon in US)', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/vAoYf67S5cA/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/vAoYf67S5cA/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/vAoYf67S5cA/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/vAoYf67S5cA/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/vAoYf67S5cA/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-01-21 13:00:29'),
(97, 'youtube#playlistItem', 'jZdV_pmHKSI', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'Best Filipino Food!! DINO BONE CANSI - Prized Dish of Bacolod, Philippines!', '🇵🇭 Philippines Chicken Inasal: https://youtu.be/Ctt0z9Db7-s\n🌶️ Get Smoked Ghost Pepper: https://amzn.to/3PNTvNQ (affiliate link)\n🔔 Subscribe: http://bit.ly/MarkWiensSubscribe\n\nBACOLOD, PHILIPPINES - We are continuing with our food tour in Bacolod, Philippines, with another stunning dish that you have to eat when you’re there - cansi. We’re going to see the full process and then go to eat one of the best meals I’ve ever had in the Philippines!\n\nThe Bacolod Food Hunters (https://bacolodfoodhunters.com/) - First of all a huge thank you to Martin and the team from The Bacolod Food Hunters for taking me around in Bacolod.\n\nEron\'s Cansi House (https://goo.gl/maps/XoLfE6gHKuEry8vX9)\n\nCansi is a dish that includes huge beef bones simmered for hours until all the flavor is released and combined with ginger and onions, green chilies, and a especially a local fruit called batwan fruit (garcinia binucao), which gives the soup its sour taste. It’s really an amazing broth and so addictive as well. When they serve you cansi you can taste all the herbs and acidity which breaks down the richness of the meat. The flavor was incredible.\n\nIn addition to cansi, at Eron’s you’ll find a full spread of local Filipino food which you can choose from. We enjoyed a variety of different dishes including local Bacolod seaweed, smashed eggplant, and some grilled pork belly.\n\nIt was a fantastic meal and something you can’t miss when you visit Bacolod! Highly recommend Eron\'s Cansi House.\n\n🎵MUSIC: \nhttps://goo.gl/HwVjdo\n\n——————————————————\n\n📱FOLLOW:\nInstagram: https://instagram.com/migrationology\nFacebook: https://www.facebook.com/migrationology\n\n——————————————————\n\n🌶️ 🌶️🌶️ NEW: Smoked Ghost Pepper Available Now: \nDirect: https://www.kivahealthfood.com/markghostpepper \nAmazon: https://amzn.to/3PNTvNQ (affiliate link on Amazon in US)', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/jZdV_pmHKSI/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/jZdV_pmHKSI/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/jZdV_pmHKSI/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/jZdV_pmHKSI/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/jZdV_pmHKSI/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-01-17 13:00:26'),
(98, 'youtube#playlistItem', 'Ctt0z9Db7-s', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'Filipino Street Food in Bacolod!! CHICKEN INASAL + Ultimate BBQ Tour in Philippines!', '🇵🇭 Philippines Oyster Mountain: https://youtu.be/VeVBWjAkurw\n🌶️ Get Smoked Ghost Pepper: https://amzn.to/3PNTvNQ (affiliate link)\n🔔 Subscribe: http://bit.ly/MarkWiensSubscribe\n\nBACOLOD, PHILIPPINES - Welcome to Bacolod, one of the food capitals of the Philippines! They are known for a few speciality foods, but probably the most famous, and a food you’ll find all over the Philippines is chicken inasal - a unique style of barbecue chicken! Today we’re going on an ultimate bbq tour in Bacolod, and we’re going to uncover the secret as to why it’s so good!\n\nThe Bacolod Food Hunters (https://bacolodfoodhunters.com/) - Huge thank you to Martin and the team from The Bacolod Food Hunters for taking me around in Bacolod and for showing me some of the best places to eat bbq!\n\nHere are the locations and the places we ate in this video:\n\nAida\'s Chicken (https://goo.gl/maps/enTN2NsSg71cAiySA) - We’re starting at Manokan Country, probably the most famous place in Bacolod for chicken inasal, and it’s really so incredibly iconic. There are a few dozen places to choose from, but Martin recommended Aida’s as one of the local favorites. We were lucky to get into the kitchen to see the grilling action, and it’s some of the most exciting grill action you’ll see! One of the secrets of chicken inasal, along with all the marinade, is the continual basting of chicken oil and anatto as its being grilled. This keeps the chicken juicy and moist, and when you eat it, you eat more chicken oil in the rice.\nTotal price - 687 PHP ($12.53) for everything.\n\nChai Rose Barbecue (https://goo.gl/maps/azVUccHJSSRMQCxj6) - To continue this Filipino food tour we went to another legendary bbq spot on Bacolod known as Chai Rose Barbecue. They have insasal as well, but their speciality is pork bbq skewers. The taste is sweet and salty and it goes great along with chicken oil rice as well.\n\nSilay City BBQ - We continued on to a small Filipino barbecue stall under a tree in Silay City. The family was so friendly and welcoming, and they have the full bbq spread of about 20 different skewers to choose from. The bbq was hot and delicious and especially good with Aunty’s homemade chili vinegar.\nTotal price - 170 PHP ($3.10)\n\nMan Plaza - Finally to complete this Filipino street food tour of barbecue and inasal in Bacolod we went to one more legendary place - a place that’s frequented by local students in the area - Man Plaza. It’s an entire bbq plaza all under one roof with about a dozen stalls to choose from. We chose a place called Royam’s. Expect plenty of smoke and friendly people!\n\nAnd that completes this ultimate Philippines barbecue inasal tour in Bacolod, one of the world’s greatest grilled chicken recipes!\n\n🎵MUSIC: \nhttps://goo.gl/HwVjdo\n\n——————————————————\n\n📱FOLLOW:\nInstagram: https://instagram.com/migrationology\nFacebook: https://www.facebook.com/migrationology\n\n——————————————————\n\n🌶️ 🌶️🌶️ NEW: Smoked Ghost Pepper Available Now: \nDirect: https://www.kivahealthfood.com/markghostpepper \nAmazon: https://amzn.to/3PNTvNQ (affiliate link on Amazon in US)', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/Ctt0z9Db7-s/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/Ctt0z9Db7-s/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/Ctt0z9Db7-s/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/Ctt0z9Db7-s/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/Ctt0z9Db7-s/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-01-14 13:00:13'),
(99, 'youtube#playlistItem', 'VeVBWjAkurw', 'UCyEd6QBSgat5kkC6svyjudA', 'Mark Wiens', 'Philippines OYSTER MOUNTAIN!! Best Filipino Food + Fresh Eels in Cebu!!', '🇵🇭 Ultimate Filipino street food tour in Cebu: https://youtu.be/ylVEQb3wbKQ\n🌶️ Get Smoked Ghost Pepper: https://amzn.to/3PNTvNQ (affiliate link)\n🔔 Subscribe: http://bit.ly/MarkWiensSubscribe\n\nCEBU, PHILIPPINES - Cebu is such a fantastic food paradise and today I’m meeting up with my friends @BhenYuri and we’re first going to harvest and eat fresh eels at a legendary restaurant. Then we’ll be going to another place that serves the freshest oysters in Cebu to eat grilled oysters and the greatest milkfish I’ve ever had. Get ready for another delicious day eating Filipino food!\n\nEntoy\'s Bakasihan (https://goo.gl/maps/3SkWA4BTd13CFHDN8) - Located on the island of Cordova, across the channel of water from Cebu is Entoy\'s Bakasihan. Unfortunately, the founder Mr Entoy has passed, but his family is keeping to the tradition. They have a fantastic story of supporting the local fishers of the island by buying their eels and cooking delicious recipes with them. We had the honor to go out into the ocean in the morning to see the harvesting process. Then we headed back to the restaurant, saw the full cooking process of eel soup and fried eels. We then had a seafood feast, straight from sea to table. It was a delicious meal, and highly recommended.\nTotal price - 950\n\nTemyong\'s Talaba (https://goo.gl/maps/Bo4BJ4Tz8t2Uaa7o9) - Next up for an oyster mountain! We headed over to Temyong\'s Talaba where they produce their own fresh oysters. We had a chance to see how they harvest them. Then you can choose your size of oysters, they grill them up fresh and you eat them with soy sauce, vinegar and calamansi. Additionally, something I didn’t even know we were going to eat was a stuffed and grilled bangus / milkfish. I’ve had it many times before, but this was the best one I’ve ever had!\nTotal price - 725\n\nBoth restaurants are legendary and if you’re looking for delicious food and a unique experience, you can’t miss them when you’re in Cebu!\n\nThank you again to @BhenYuri for taking me around, be sure to follow them for many more food videos in Cebu.\n\n🎵MUSIC: \nhttps://goo.gl/HwVjdo\n\n——————————————————\n\n📱FOLLOW:\nInstagram: https://instagram.com/migrationology\nFacebook: https://www.facebook.com/migrationology\n\n——————————————————\n\n🌶️ 🌶️🌶️ NEW: Smoked Ghost Pepper Available Now: \nDirect: https://www.kivahealthfood.com/markghostpepper \nAmazon: https://amzn.to/3PNTvNQ (affiliate link on Amazon in US)', '{\"high\": {\"url\": \"https://i.ytimg.com/vi/VeVBWjAkurw/hqdefault.jpg\", \"width\": 480, \"height\": 360}, \"maxres\": {\"url\": \"https://i.ytimg.com/vi/VeVBWjAkurw/maxresdefault.jpg\", \"width\": 1280, \"height\": 720}, \"medium\": {\"url\": \"https://i.ytimg.com/vi/VeVBWjAkurw/mqdefault.jpg\", \"width\": 320, \"height\": 180}, \"default\": {\"url\": \"https://i.ytimg.com/vi/VeVBWjAkurw/default.jpg\", \"width\": 120, \"height\": 90}, \"standard\": {\"url\": \"https://i.ytimg.com/vi/VeVBWjAkurw/sddefault.jpg\", \"width\": 640, \"height\": 480}}', '2023-01-07 13:00:26');
